(3595, '0607488533', 'Prótesis de cadera no cementada de titanio cromo- cobalto con o sin molibdeno acero cromo o acero inoxidable al alto nitrogeno. Todos los componentes deben ser compatibles entre si. Incluye dimensiones intermedias entre las especificadas. La seleccion del material y las medidas estara a cargo de las unidades de atencion de acuerdo a sus necesidades. Acetábulo de titanio con recubrimiento de microestructuras multiorificios para tornillo de fijación de 6 a 6.5 mm con diámetro externo de 40 a 60 mi', '', '', '', 'PATENTE', 'SI', '0000-00-00 00:00:00'),
(3596, '0607488541', 'Prótesis de cadera no cementada de titanio cromo-cobalto con o sin molibdeno acero cromo o acero inoxidable al alto nitrógeno. Todos los componentes deben ser compatibles entre sí. Incluye dimensiones intermedias entre las especificadas. La selección del material y las medidas estará a cargo de las unidades de atención de acuerdo a sus necesidades. Cabeza modular de cromo cobalto o molibdeno cono 12-14 de diámetro externo 22 y 28 mm cuello estándar medidas de -5 a +15.5 Pieza.', 'PZA', '1', 'PZA', 'PATENTE', 'SI', '0000-00-00 00:00:00'),
(3597, '0607488558', 'Protesis de cadera para revision cementada o no cementada. Todos los componentes deben ser compatibles entre si. Incluye dimensiones intermedias entre las especificadas. la seleccion del material y las medidas estara a cargo de las unidades de atencion de acuerdo a sus necesidades. Cabeza modular de cromo cobalto molibdeno para cono 12-14 de diámetro externo de 22 -32 mm cuello estándar con medidas de -5 a 15.5 mm. Pieza.', '', '', '', 'PATENTE', 'SI', '0000-00-00 00:00:00'),
