(3606, '0607488640', 'Protesis de revision de rodilla.La seleccion del material y las medidas estara a cargo de las unidades de atencion de acuerdo a sus necesidades. Diseño del componente femoral modular en aleación de cobalto y cromo. Derecho o izquierdo. Pieza.', 'PZA', '1', 'PZA', 'PATENTE', 'SI', '0000-00-00 00:00:00'),
