(3608, '0607488665', 'Protesis de revision de rodilla.La seleccion del material y las medidas estara a cargo de las unidades de atencion de acuerdo a sus necesidades. Diseño de platillo tibial modular. Con anillo. Con normalizaciones. Pieza.', 'PZA', '1', 'PZA', 'PATENTE', 'SI', '0000-00-00 00:00:00'),
