(3610, '0607488681', 'Protesis de revision de rodilla.La seleccion del material y las medidas estara a cargo de las unidades de atencion de acuerdo a sus necesidades. Implantes con soporte tibial UHMWPE. Con estabilización posterior varo-valgo y estabilidad rotatoria con poste metálico central. En polietileno de ultra alta densidad con doble enlace cruzado. En alturas desde 10.0 mm hasta 24.0 mm. Pieza.', '', '', '', 'PATENTE', 'SI', '0000-00-00 00:00:00'),
(3611, '0607488699', 'Protesis de revision de rodilla.La seleccion del material y las medidas estara a cargo de las unidades de atencion de acuerdo a sus necesidades. Adaptadores de compensación (Offset). En 4.0 mm 6.0 mm y 8.0 mm para adoptar una posición radial sobre la extensión del vástago permitiendo una cobertura óptima del hueso para aplicaciones tibiales. Las capacidades de ajuste minimizan el riesgo de que sobresalga la bandeja tibial lo cual puede ocurrir al utilizar extensores del vástago debido a su diseñ', 'PZA', '1', 'PZA', 'PATENTE', 'SI', '0000-00-00 00:00:00'),
