(3822, '0608330015', 'Prótesis para miembro toracico. Todos los componentes deben ser compatibles entre si. La seleccion de las medidas estara a cargo de las unidades de atencion de acuerdo a sus necesidades. Para hombro. Cabeza humeral de cromo-cobalto o cromo-cobalto-molibdeno de 40 mm a 56 mm de diámetro. Altura: de 12.0 mm a 21.0 mm. Incluye medidas intermedias entre las especificadas. Pieza.', 'ENV', '1', 'PZA', 'generico', 'SI', '0000-00-00 00:00:00'),
(3823, '0608330098', 'Prótesis para miembro toracico. Todos los componentes deben ser compatibles entre si. La seleccion de las medidas estara a cargo de las unidades de atencion de acuerdo a sus necesidades. Para hombro. Componente humeral cementado o no cementado. Con diámetro distal de 6 mm a 14 mm y longitud de 110 mm a 220 mm Incluyen medidas intermedias entre las especificadas. Pieza.', 'ENV', '3000', 'ML.', 'generico', 'SI', '0000-00-00 00:00:00'),
(3824, '0608330171', 'Prótesis de cadera cementada de cromo-cobalto con o sin molibdeno acero cromo o acero inoxidable al alto nitrógeno. Todos los componentes deben ser compatibles entre sí. Incluye dimensiones intermedias entre las especificadas. Acetábulo de polietileno de ultra alto peso molecular con enlaces cruzados por multiirradiación con ceja de 10 a 20 grados alambre radiopaco ecuatorial y/o polar de forma semiesférica con diámetro interno de 22 mm ó 28 mm estéril. Diámetro externo de: 36.0 mm a 60.0 mm. In', 'ENV', '1', 'PZA', 'generico', 'SI', '0000-00-00 00:00:00'),
(3825, '0608330189', 'Prótesis de cadera cementada de cromo-cobalto con o sin molibdeno acero cromo o acero inoxidable al alto nitrógeno. Todos los componentes deben ser compatibles entre sí. Incluye dimensiones intermedias entre las especificadas. Componentes acetabulares. Compatibles con la cabeza y el vástago femoral. Acetábulo de polietileno de ultra alto peso molecular con enlaces cruzados por multiirradiación con ceja de 10 a 20 grados alambre radiopaco ecuatorial y/o polar de forma semiesférica con diámetro in', 'ENV', '5', 'ML.', 'generico', 'SI', '0000-00-00 00:00:00'),
(3826, '0608330197', 'Prótesis de cadera cementada de cromo-cobalto con o sin molibdeno acero cromo o acero inoxidable al alto nitrógeno. Todos los componentes deben ser compatibles entre sí. Incluye dimensiones intermedias entre las especificadas. Componente femoral modular de diferentes perfiles con centralizador y ángulo variable con o sin collar cono 12-14. Ancho de: 6.0 mm a 20.0 mm. Incluye medidas intermedias entre las especificadas. Pieza.', 'ENV', '1', 'FCO', 'generico', 'SI', '0000-00-00 00:00:00'),
(3827, '0608330254', 'Prótesis de cadera cementada de cromo-cobalto con o sin molibdeno acero cromo o acero inoxidable al alto nitrógeno. Todos los componentes deben ser compatibles entre sí. Incluye dimensiones intermedias entre las especificadas. Anillos. Anillo de reforzamiento de techo cotiloideo con gancho distal. Para los sistemas que lo requieran. Diámetro externo de: 42.0 mm a 60.0 mm. Incluye medidas intermedias entre las especificadas. Pieza.', 'ENV', '1', 'EST', 'generico', 'SI', '0000-00-00 00:00:00'),
(3828, '0608330270', 'Prótesis de cadera cementada de cromo-cobalto con o sin molibdeno acero cromo o acero inoxidable al alto nitrógeno. Todos los componentes deben ser compatibles entre sí. Incluye dimensiones intermedias entre las especificadas. Anillos. Anillo para reconstrucción acetabular anatómico atornillado con gancho distal y aleta para anclaje al ilíaco de acero inoxidable o titanio. Diámetro externo de: 46.0 mm a 65.0 mm. Incluye medidas intermedias entre las especificadas. Para los sistemas que lo requie', 'ENV', '500', 'ML.', 'generico', 'SI', '0000-00-00 00:00:00'),
(3829, '0608330288', 'Prótesis de cadera no cementada en aleación de titanio con o sin recubrimiento osteointegrador. Todos los componentes deben ser compatibles entre sí. Incluye dimensiones intermedias entre las especificadas. La selección de las medidas estará a cargo de las unidades de atención de acuerdo a sus necesidades. Componentes acetabulares con base metálica de titanio con recubrimiento poroso y encaje a presión con tetones o tornillos centrales que incluya tornillos accesorio e insertos de 22 mm ó 28 mm ', 'ENV', '1', 'TBO', 'generico', 'SI', '0000-00-00 00:00:00'),
(3830, '0608330296', 'Prótesis de cadera para revisión cementada o no cementada. Todos los componentes deben ser compatibles entre si. Incluye dimensiones intermedias entre las especificadas. La selección del material y las medidas estara a cargo de las unidades de atención de acuerdo a sus necesidades. Componentes femorales. Vástago para revisión de 180 mm a 260 mm de longitud con cono 12-14. Diámetro de: 7.0 mm a 20.0 mm. Incluye medidas intermedias entre las especificadas. Pieza', '', '', '', 'generico', 'SI', '0000-00-00 00:00:00'),
(3831, '0608330312', 'Prótesis tumoral. Todos los componentes deben ser compatibles entre sí. Incluye dimensiones intermedias entre las especificadas. La selección del material y las medidas estará a cargo de las unidades de atención de acuerdo a sus necesidades. Para Cadera. Cuerpo femoral proximal de cromo cobalto con orificios laterales y orificios mediales en región proximal para reinserción. Longitud de 70.0 mm o de altura de reemplazo. Pieza.', 'ENV', '1', 'LT', 'generico', 'SI', '0000-00-00 00:00:00'),
