(5397, '0806102653', 'Pruebas Rápidas. Prueba rápida para la determinación cualitativa de anticuerpos IgG por inmunocromatografía contra el virus de la Inmunodeficiencia Humana tipo 1 (VIH-1) y tipo 2 (VIH-2) en fluido oral sangre capilar sangre total y plasma. Para uso como prueba de tamizaje. Requiere prueba confirmatoria. Equipo para 25 pruebas. TATC.', '', '', '', 'generico', 'SI', '0000-00-00 00:00:00'),
