(6489, '0808295422', 'Pruebas Rápidas. Prueba rápida inmunocromatográfica para la determinación cualitativa y diferenciación de antígenos del Virus de la Influenza tipo A y B a partir de muestras nasales y nasofaríngeas. Con una sensibilidad no menor al 80%  y una especificidad no menor al 80% de acuerdo con el certificado de evaluación diagnóstica del Instituto de Diagnóstico y Referencia Epidemiológicos. Incluye controles positivo y negativo. Requiere prueba confirmatoria. Envase para mínimo 20 pruebas.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(6490, '0808295430', 'Sustancias biológicas Columnas de intercambio iónico cargadas positivamente para extracción de ácidos nucleicos. Incluye camisas para recepción de líquidos. Con soluciones de lisis lavado y recuperación. TATC Las características y el rendimiento (µcg/ml) serán seleccionadas de acuerdo a las necesidades de las unidades médicas.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(6491, '0808295448', 'Sustancias biológicas Oligonucleótidos con secuencia de hasta 40 pares de bases. Concentración mínima de 240 nanomoles o su equivalente en unidades de densidad óptica. Con o sin marcaje. CTC. Las unidades médicas definirán las características del marcaje de acuerdo a la técnica que se utilice.', 'ENV', '1', 'PBA', 'generico', 'NO', '0000-00-00 00:00:00'),
(6492, '0808295455', 'Reactivos y Juegos de reactivos para pruebas específicas Dengue. Reactivo para determinar antígeno NS1 del virus del Dengue (serotipos 1 2 3 y 4) en suero o plasma humano por técnica Inmunoenzimática. Para mínimo 96 pruebas. RTC', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(6493, '0808295463', 'Pruebas Rápidas. Prueba rápida inmunocromatográfica para la determinación de anticuerpos de Treponema pallidum en suero o plasma humano. Con sensibilidad no menor al 95% y una especificidad no menor al 98% de acuerdo con el certificado de evaluación diagnóstica del Instituto de Diagnóstico y Referencia Epidemiológicos. Requiere prueba confirmatoria. Envase para mínimo 20 pruebas.', 'ENV', '20', 'PBA', 'generico', 'NO', '0000-00-00 00:00:00'),
