(7150, '5310050049', 'Acelerador Lineal de Electrones. Acelerador lineal de electrones móvil con capacidad de funcionar dentro de la sala de cirugía y cuya finalidad de uso es proporcionar una alta dosis de radioterapia por electrones en tiempos cortos. Con al menos cuatro niveles de energía de electrones dentro del rango de 4 a 12 MeV. Tasa de dosis en el rango de 5 Gy/min o menor a 20 Gy/min. Dimensiones de los campos diámetro de: 3 4 5 6. 7 8 y 10 cm. Aplanado del haz de radiación menor o igual al 3% para diámetro', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7151, '5310230015', 'Angioscopio. Equipo para la exploración interna de los vasos con el propósito de establecer diagnóstico y plan de manejo. Angioscopio de fibra óptica con mesa soporte de dos entrePaños un cajón soporte para irrigación caja de salida múltiple y fuente de poder. Fibras ópticas PF/14 PF/28 PF/76.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7152, '5310320055', 'Amalgamador y dosificador estomatológico. Equipo portátil automático para la conformación de amalgamas. Integrado por un depósito para mercurio y otro para limadura. Dosificador. Reloj.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7153, '5310480032', 'Monitor de anticoagulación. Medidor digital de la titulación de heparina-protamina para vigilar y controlar la anticoagulación; dosis respuesta a la heparina y tiempo de coagulación activado. Reactivo en cartucho para tiempo de coagulación activado dosis respuesta de la heparina titulación de heparina-protamina de alto rango y titulación de heparina-protamina de bajo rango.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7154, '5310480040', 'Analizadores. Analizador clínico portátil de sangre. Equipo portátil para la determinación de los siguientes analitos y parámetros seleccionables de acuerdo a las necesidades de las unidades médicas: Analitos: Glucosa Nitrógeno ureico Creatinina. Hemoglobina y Hematocrito. Electrolitos Gases Bilirrubinas Transaminasas Lactato. Parámetros: Tiempo de respuesta volumen de muestra almacenamiento de información.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7155, '5310480214', 'Co-oxímetro. Aparato analizador de fracciones de hemoglobina en sangre. Analizador de hemoglobina total oxihemoglobina carboxihemoglobina metahemoglobina hemoglobina reducida; contenido total captación y saturación de oxígeno; a través de diferentes longitudes de onda infrarroja por medio de toma de muestra de 85 a 175 microlitros. Consta de pantalla de video integrada salida RS232C para conexión a computadora. Programas de autocalibración autodiagnóstico de fallas y de mantenimiento preventivo ', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7156, '5310480263', 'Analizadores. Analizador de Hemoglobina Glucosilada. Equipo para la determinación de hemoglobina glucosilada. Con las siguientes características seleccionables de acuerdo a las necesidades de las unidades médicas: Principio de medición: cromatografía de intercambio iónico cromatografía por afinidad colorimetría inmunoturbidimetría o electroforesis. Automatizado o semiautomatizado. Capacidad de procesamiento de muestras por hora. Volumen de muestra. Lector de código de barras. Software en español', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7157, '5310480271', 'Analizador de haz de radiación para verificación rutinaria de aplanamiento. Unidad portátil para verificación diaria de los diferentes niveles de radiación en aceleradores lineales de electrones. Controlado por microprocesador y que incluya microcomputadora. Cinco o más detectores. Medición de dosis y/o tasas de dosis. Que mida constancia aplanado energía y simetría de haz de radiación de: intervalos de energía 2 a 20 MV y para electrones de: 4 a 25 MeV. Que permita comparaciones con mediciones ', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7158, '5310480297', 'Analizadores. Equipo portátil de determinación de lípidos. Equipo portátil para determinación cuantitativa de perfil de lípidos en sangre  total tipo maletín y/o portatil. Que determine cuantitativamente colesterol total lipoproteínas de alta y de baja densidad triglicéridos y/o glucosa y/o calcule el resto de parámetros así como el riesgo aterogénico. Procese 12 pruebas por hora por equipo mínimo. Puede o no contar con capacidad de conectarse a equipos de cómputo para almacenamiento de resultad', '-', '-', '-', 'generico', 'NO', '0000-00-00 00:00:00'),
(7159, '5310480306', 'Analizador de sangre oculta en heces. Equipo utilizado para la detección de manera cualitativa y cuantitativa de sangre oculta en heces como apoyo en el diagnóstico de diversos padecimientos gastrointestinales colitis pólipos y cáncer colorectal. El equipo realiza una prueba de inmunoquímica automatizada para identificar sangre oculta en la materia fecal bajo el método de inmunoensayo con fijación de látex como principio de funcionamiento. Se mide el cambio óptico en la absorbancia de la muestra', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
