(7206, '5311400344', 'Bomba de infusión volumétrica. Equipo portátil para administrar medicamentos y soluciones parenterales o nutrición parenteral en forma constante. Con las siguientes características seleccionables de acuerdo a las necesidades de las unidades médicas: bomba. Operación volumétrica. Modo de funcionamiento continuo. Rango de flujo inferior y límite superior. Resolución. Rango de volumen mínimo y máximo. Flujo MVA (kvo). Máximo. Con sistema de seguridad de aire en la línea. Capacidad de aceptar difere', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7207, '5311400369', 'Bomba para la administración subcutánea de insulina. Equipo bomba para la administración subcutánea de insulina. Bomba microinfusora de insulina para cubrir las necesidades fisiológicas individuales de la hormona en 24 hrs. Con programación de acuerdo a la ingesta de alimentos. Con la posibilidad de incrementar la dosis programada. Con memoria de datos y mensajes de error. Con sistema de seguridad contra posibles infra o sobre dosis. Confirmación visual y auditiva de las instrucciones. Peso 100 ', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7208, '5311400393', 'Bomba de infusión portátil. Sistema computarizado de infusión intravenosa para administrar volúmenes pequeños a dosis regulables. Bomba de infusión computarizada portátil que puede ser integrada a tripié. Rango de dosis en ml/h con posibilidad de incremento. Capacidad de cambiar dosis sin interrumpir la infusión con memoria de los volúmenes infundidos. Equipo de infusión específico para cada líquido. Que funcione con corriente alterna y batería autorrecargable. Equipada con alarmas audible y vis', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7209, '5311400401', 'Sistema de infusión rápida. Equipó móvil de soporte de vida para la administración de altos volúmenes de fluidos en tiempos cortos con temperatura predeterminada en pacientes que requieren de transplante de hígado durante el transoperatorio con base rodable. Con tecnología basada en microprocesador. Consola integrada por: Panel de control interconstruido para: encendido y apagado. Volumen de infusión de 0 a 1500 ml en pasos de 500 ml. Selector para demanda de fluidos o volumen adicional de 100 ó', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7210, '5311400419', 'Infusión rápida con calentador de fluídos en linea sistema de. Bomba infusora con sistema de calentamiento portátil montado en poste postes para soluciones. Con infusores automáticos de presión capacidad de infusión de soluciones calientes. Unidad termorreguladora con panel de control para encendido apagado comprobación del correcto funcionamiento de las alarmas indicador de temperatura. Alarmas audibles y visibles.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7211, '5311410079', 'Bota fresa.  Bota fresa Starflite.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7212, '5311460629', 'Broncofibroscopio pediátrico. Equipo para observar vías respiratorias altas con fines diagnósticos y terapéuticos. Endoscopio de fibra óptica flexible ángulo visual: 120 ° visión frontal; profundidad de campo 5 a 50 mm diámetros externos: tubo de inserción 3.6 mm y extremo distal 3.5 mm; flexión de la punta 180 ° hacia arriba y 130 ° hacia abajo longitud total 840 mm longitud de trabajo 550 mm y canal de trabajo de mínimo 1.2 mm.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7213, '5311460785', 'Broncoscopio rígido. Equipo para observar tráquea y bronquios con fines diagnósticos y terapéuticos. Consta de: Endoscopio rígido con porción proximal más amplia tubo adaptable a cualquier aparato de anestesia iluminación de luz fría intensa y fija. Longitud y calibre trampa para recolectar especímenes. Las especificaciones de cada uno de los elementos señalados serán determinadas por las unidades médicas de acuerdo a sus necesidades.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7214, '5311461502', 'Broncofibroscopio. Equipo para observar tráquea y bronquios con fines diagnósticos y terapéuticos. Endoscopio de fibra óptica flexible ángulo visual: 120 ° visión frontal; profundidad de campo 3 a 50 mm diámetro externo: 6 mm; flexión de la punta 180 ° hacia arriba y 130 ° hacia abajo longitud total 840 mm longitud de trabajo 550 mm y canal de trabajo 3.2 mm.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7215, '5311461536', 'Videobroncoscopio pediátrico.. Equipo para observar tráquea y bronquios con fines diagnósticos y terapéuticos. Endoscopio de fibra óptica flexible sumergible ángulo visual: 120 ° visión frontal; profundidad de campo 3 a 50 mm diámetros externos: tubo de inserción 3.4 mm y extremo distal 3.6 mm flexión de la punta: 180 ° hacia arriba y 130 ° hacia abajo; longitudes aproximadas total 600 mm y de trabajo 550 mm; canal de trabajo mínimo 1.8 mm.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7216, '5311461544', 'Videobroncoscopio. Equipo computarizado con videoprocesador de imágenes invasivo utilizado para el diagnóstico y tratamiento. Tubo de inserción entre 5.9 y 6 mm de diámetro. Longitud de 55 a 60 cm. Canal de trabajo dentro del rango de 2.5 a 2.6 mm. Angulos de flexión arriba: Mayor de 170 grados abajo: Mayor de 120 ° grados. Botón para congelar imagen en el cuerpo del endoscopio. Botón para activar la videoimpresora en el cuerpo del endoscopio. Con chip integrado en la punta distal. Videoprocesad', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7217, '5311461569', 'Broncoscopio flexible ultrafino pediátrico.. Instrumento para observar tráquea y bronquios en pacientes pediátricos con fines diagnósticos y terapéuticos. Endoscopio de fibra óptica flexible pediátrico con fibra conductora de luz diámetro 2.2 mm. Longitud de trabajo 550 mm. campo visual 75 ° sin canal de biopsia angulación 90 a 160 grados.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7218, '5311461577', 'Broncoscopio flexible de fibra óptica. Equipo portátil de diagnóstico y tratamiento para vías aéreas altas y bajas con capacidad para la extracción de cuerpos extraños invasivo. Tubo de inserción entre 5.9 y 6 mm de diámetro. Longitud de 55 a 60 cm. Canal de trabajo dentro del rango de 2.6 a 2.8 mm. Angulos de flexión arriba: mayor de 170 grados abajo: mayor de 120 grados. Fuente de luz mínimo de 150 watts. Halógena. Ajuste de intensidad de luz. Estuche rígido para guarda. Pinza de biopsia.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7219, '5311520018', 'Cabezal de mayfield pediátrico.. Equipo para darle diferentes posiciones al paciente pediátrico durante la cirugía y mantenerlo o modificarla de acuerdo a las necesidades del especialista. Cabezal de mayfield pediátrico que incluya: Unidad básica ajustable para cabezal adaptador con pivote esférico giratorio cabecera en forma de herradura ajustable de gel tamaño pediátrico con pivote giratorio sujetador de cabecera craneal para pinchos (3 o 5 puntas) juego de 3 o 5 pinchos craneales reutilizable', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
