(7222, '5311520059', 'Cabezal tipo mayfield adulto. Equipo para darle diferentes posiciones al paciente durante la cirugía y mantenerlo o modificarla de acuerdo a las necesidades del especialista. Cabezal de Mayfield. que incluya: Unidad básica ajustable para cabezal adaptador con pivote esférico giratorio cabecera en forma de herradura ajustable de gel tamaño adulto con pivote giratorio cabecera en forma de herradura ajustable de gel tamaño pediátrico con pivote giratorio sujetador de cabecera craneal para pinchos (', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
