(7237, '5311560139', 'Cama de terapia: cinética pulsátil y percusiva. Cama de terapia: cinética pulsátil y percusiva continua con reducción de presión. Eléctrica e hidraúlica con capacidad de rotar bilateralmente arriba de 40 ° (con incremento de 5 °) reducción de presión menor al cierre capilar percusión y vibración durante la rotación soporte para cabeza y cuello pantalla o display para información de la enfermera control microprocesado para programación individualizada flujo continuo de aire a través de los cojine', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7238, '5311560147', 'Cama camilla radiotransparente. Camilla hidráulica y neumática rodable para facilitar la realización de estudios radiológicos y fluoroscópicos. Con base radiotransparente. Con sujetador o charola para casetes de Rayos X. Control hidráulico o neumático de movimientos. Posiciones. Sistema de ajuste de altura. Protección antichoque. Barandales abatibles con seguros. Ruedas con sistema de freno. Sistema que permita girar o dar direccionamiento. Compartimiento para tanque de oxígeno. Colchón. Correas', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7239, '5311570062', 'Cámara sonoamortiguada con compartimiento sencillo. Unidad aislante de ruido que se utiliza para realizar audiometrías con fines de diagnóstico. Piso cubierto con alfombra para tránsito pesado o material acústico aislado. Puerta acústica sellada. Ventana para observación con doble cristal para aislamiento acústico (mínimo 7 mm de espesor). Repisa exterior para colocación de audiómetro y accesorios. Receptáculo o tablero para interconexión del exterior al interior de la cámara. Iluminación interi', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7240, '5311570070', 'Cámara sonoamortiguada con compartimiento doble. Equipo auxiliar para aislar al paciente del ruido ambiental durante la realización de estudios audiológicos. Cámara con capacidad para dos personas. Piso cubierto con alfombra o material aislante al ruido y a la vibración. Puerta con cierre hermético aislante al ruido. Paredes de material aislante al ruido y a la vibración. Ventana de observación con doble cristal para aislamiento acústico con un mínimo de 6.5 mm de espesor cada uno. Repisa exteri', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
