(7247, '5311570716', 'Cámara de ionización para dosimetría de electrones. Unidad portátil para medición de haces de electrones ideal para fantasma de agua. Cámara tipo Markus. Volumen 0.055 centímetros cúbicos. Respuesta de 1 x 10 -9 C/GY. Voltaje de polarización máximo 300 V. Espesor de la membrana 0.03 mm. Electrodo PMMA cubierta de grafito 5.3 mm de diámetro. Material de la pared PE (CH2)N. Cable 15 m.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7248, '5311570724', 'Cámara de centelleo de dos detectores de ángulo variable de aplicación general. Gammacámara de centelleo de dos detectores para estudios de aplicación general. Con dos detectores rectangulares digitales con Tubos. fotomultiplicadores y angulación cada uno. Para adquisición SPECT. Con campo de visión de cada detector. Rango de energía detectable. Capacidad de contar kcps en modo SPECT con resolución espacial intrínseca en el campo de visión útil (UFOV) linealidad espacial intrínseca absoluta en c', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7249, '5311570732', 'Cámara de centelleo de dos detectores de ángulo variable con posibilidad de estudios por coincidencia.. Gammacámara de centelleo de dos detectores para estudios diagnósticos por coincidencia. Con dos detectores rectangulares digitales con Tubos. fotomultiplicadores cada uno para adquisición SPECT con detectores angulables y campo de visión de cada detector. Con cristal. Rango de energía detectable. Capacidad de contar kcps en modo SPECT con resolución espacial intrínseca en el campo de visión út', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
