(7251, '5311570773', 'Cámara digital no midriatica para fondo de ojo. Cámara digital oftalmológica utilizada para fotografiar y registrar imágenes del fondo del ojo sin necesidad de dilatar la pupila. Con las siguientes características seleccionables de acuerdo a necesidades de las unidades médicas: Angulo de convergencia o de campo del segmento anterior y posterior de al menos 45°. Enfoque: Fijación interna del ojo; brazo interconstruido con punto de fijación externa; alineación manual; enfoque automático y manual a', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7252, '5311570786', 'Cámara digital no midriatica para fondo de ojo con capacidad para estudios de fluorangiografía. Cámara digital oftalmológica utilizada para fotografiar y registrar imágenes del fondo del ojo sin necesidad de dilatar la pupila; con capacidad para realizar estudios de fluorangiografía. Con las siguientes características seleccionables de acuerdo a necesidades de las unidades médicas: Angulos de convergencia o de campo del segmento anterior y posterior: uno obligatorio de 45° y el otro de 50° ó 30°', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
