(7323, '5312920258', 'Cardiotocógrafo. Equipo para observar la actividad cardiaca fetal. Equipo para la detección de frecuencia cardiaca fetal por efecto Doppler y actividad uterina por método no invasivo. Un transductor multicristal para frecuencia cardiaca fetal. Un transductor para la actividad uterina. Registrador térmico con dos canales uno para toco y otro para cardio. Dos velocidades como mínimo dentro del rango 1 a 3 cm/min. con autoprueba. Despliegue numérico en pantalla de: latidos/minuto fetal con rango de', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
