(7326, '5312951188', 'Estuche de diagnóstico básico. Equipo utilizado para la exploración física del paciente con fines diagnósticos. Consta de los siguientes elementos: Otoscopio con iluminación. Espéculos reusables en diferentes tamaños. Oftalmoscopio con iluminación. Con selector de aperturas y lentes. Mango recargable directo a la corriente y para uso con baterías alcalinas o sólo para baterías alcalinas. Control de intensidad de luz. Acoplamiento de otoscopio y oftalmoscopio al mango. Con caja o estuche. Las esp', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
