(7399, '5313430174', 'Ergómetro para miembros inferiores. Equipo con resistencia isocinética para miembros inferiores. Consta de los siguientes elementos: acomodación a velocidades fijas. Selector de velocidad con capacidad de cambio sin interrumpir el ejercicio. Carga de trabajo seleccionable en rpm. Cronómetro con señal acústica al llegar al tiempo programado. Despliegue del medidor en Kg-m./min. a caloría/min. Tabla de conversión de kilogramo/minuto a caloría. Manubrios de altura ajustable. Asiento de altura ajust', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7400, '5313430182', 'Ergómetro para miembros superiores. Equipo con resistencia isocinética para miembros superiores. Consta de los siguientes elementos: resistencia isocinética de acomodación a velocidades fijas. Selector de velocidad con capacidad de cambio sin interrumpir el ejercicio. Carga de trabajo seleccionable en rpm. Cronómetro con señal acústica al llegar al tiempo programado con despliegue analógico del medidor en kg-m./min. Tabla de conversión de kilogrametro/ minuto a caloría/minuto. Manubrios independ', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7401, '5313450016', 'Analizadores. Glucómetro. Unidad portátil para medir glicemia. Descripción: Con pantalla de cristal líquido. Método de medición: electroquímico o reflectancia. Capacidad de medición hasta 500 o 600 mg/dl sin necesidad de limpiar o enjuagar. Dispositivo de punción semiautomática para la obtención de muestras de sangre capilar. Volumen de muestra máximo de 10 microlitros. Tiempo de prueba: máximo 45 segundos. Con o sin memoria de pruebas. Indicador visual de batería baja. Temperatura de operación ', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7402, '5313450255', 'Equipo de administración de radioaerosoles. Sistema generador de aerosoles que administra partículas radiactivas para estudios gamagráficos pulmonares. Sistema que permite la administración de nebulizado con tamaño de partículas de 0.8 * para valorar la permeabilidad pulmonar epitelial así como la ventilación pulmonar en forma objetiva. Contiene un nebulizador boquilla para paciente filtros Tubos. corrugados trampas bolsa recolectora. Alimentado por tanque de oxígeno o central.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7403, '5313450263', 'Analizadores. Biosensor para medir en sangre: glucosa (en un rango de 20 A 600 mg/dl y en un tiempo aproximado de 12 segundos) colesterol (en un rango de 150 A 300 mg/dl y en un tiempo aproximado de 3 minutos); y triglicéridos (en un rango de 70 a 600 mg/dl en un tiempo aproximado de 3 minutos); con memorias. Tiras reactivas. Lancetas. Accesorios: dispositivo de punción.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7404, '5313450321', 'Equipo neumático para isquemia. Equipo electroneumático rodable para reducir el flujo sanguíneo en las extremidades torácicas y pélvicas con fines terapéuticos. Con las siguientes características seleccionables de acuerdo a las necesidades de las unidades médicas: Controlado electrónicamente por microprocesador. Puertos de salida para manejar torniquetes. Interruptor para controlar torniquetes. Paneles de control y monitoreo independientes para cada torniquete para ajuste de: presión tiempo de i', 'EQP', '1', 'EQP', 'generico', 'NO', '0000-00-00 00:00:00'),
(7405, '5313450332', 'Equipo para liberación endoscópica del túnel del carpo. Equipo portátil para liberación de ligamento transverso del túnel del carpo para cirugía endoscópica de mano; compuesto por una pieza de mano con gatillo un ensamble de navaja desechable retráctil con escala en cm y ventana en la punta para visualizar directamente el ligamento; con endoscopio de 3 mm y adaptador universal compatible con la fuente de luz.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7406, '5313450344', 'Medidor de glucemia. Equipo para determinación cuantitativa de la glucemia en sangre capilar fresca. Estuche con medidor con pila e instrucciones de uso. Medidor de glucemia puede ser conectado a un ordenador que automáticamente descarga un software con el cual se pueden transferir los datos de las mediciones. El software permite la visualización de la información de los niveles de glucosa del paciente en tiempo real lo que le permite al profesional de la salud analizar los niveles de glucosa de', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7407, '5313470030', 'Esfinterotomos. Para vías biliares. Con las siguientes características seleccionables de acuerdo a marca modelo y necesidades de las unidades médicas: calibre longitud alambre guía y alambre de corte. Pieza.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7408, '5313470071', 'Esfinterotomos. Para pacientes con Billroth II calibre 5.5 Fr longitud 200 cm Tipo: Soehendra. Pieza.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7409, '5313490012', 'Microkjeldahl. Para determinar Nitrógeno proteico en productos alimenticios granos alergenos etc. Consta de aparatos de digestión con parrilla múltiple y de destilación diseñado para destilación rápida y semiautomática de los productos digeridos. 127 V y 60 Hz.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7410, '5313500026', 'Láser quirúrgico neodynium-yag. Equipo rodable utilizado con rayo láser con regulador de intensidad. Energía de fotodisrupción de 2.8 mj o menor en el aire. Modo supergaussiano energía máxima: pulso sencillo 10mj Pulso doble 25 mj Pulso triple 40 mj Atenuación de la energía en 9 escalones Duración del pulso menor a 4ns Frecuencia del pulso máximo 2 Hz posibilidad de disparo con interruptor manual o pedal. Diámetro del foco: Mínimo 10 micras en aire. Haz de guía ojo diodo láser Intensidad de 670 ', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7411, '5313500075', 'Láser quirúrgico de bióxido de carbono. Equipo de rayo Láser para maniobra quirúrgica de corte coagulación y vaporización en cirugía general y microcirugía. Aparato de rayos Láser de CO2 en base rodable potencia de 20 a 150 W sobre tejido operación continua y pulsada con brazo articulado de fibra de carbono y sistema de balanceo del brazo en base a resorte enfriamiento por aire. Capacidad para almacenamiento de protocolos.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7412, '5313500083', 'Equipo de láser de luminoterapia contínua. Con longitud de onda de 600 a 900 nm. de 2.5 a 5000 Hz. Control de intensidad regulador automático de tiempo de tratamiento e indicadores de potencia y voltaje.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7413, '5313500091', 'Láser portátil equipo de. Equipo para aplicar terapia con láser. Consta de los siguiente elementos: peso programas cálculo de la dosis modalidad de tratamiento potencia pico rango de pulsos y longitud de onda con pantalla celda sensora de emisión láser alarma de fin de tratamiento. Las especificaciones de cada uno de los elementos señalados serán determinadas por las unidades médicas de acuerdo a sus necesidades.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7414, '5313500109', 'Flexoextensor para movilización contínua y pasiva de cadera y rodilla. Equipo electromecánico para la movilización continua y pasiva de cadera y rodilla en flexión y extensión para evitar adherencias o anquilosamiento. Con las siguientes características de acuerdo a las necesidades de las unidades médicas: Funciones: Pausa velocidad tiempo de tratamiento alcance o amplitud de movimiento peso material y dimensiones.', 'EQP', '1', 'EQP', 'generico', 'NO', '0000-00-00 00:00:00'),
(7415, '5313500125', 'Láser oftálmico. Equipo láser para fotocoagulación. Unidad de fotocoagulación con lámpara excitadora de argón fuente de poder sistema de tintes sistema de filtro protector para instalar microscopios quirúrgicos liberador de disparo por pedal. Consola de controles para regular poder duración contador de disparos e intensidad de luz o guía trazadora.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7416, '5313500133', 'Láser quirúrgico de holmio. Equipo para excisión incisión ablación y vaporización de tejidos sin sangrado además de fragmentación de cálculos. Consta de generador láser con: longitud de onda potencia de pulso despliegue de salida frecuencia en Hz fibra óptica modos o formas de onda amplitud del pulso control de emisión activado por pedal haz de generador láser sistema de enfriamiento integrado; monitor con despliegue y mensajes de error de falla con pantalla sensible al tacto. Las especificacion', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7417, '5313500149', 'Láser Quirúrgico. El sistema láser está destinado para uso en resección endoscópica (cistoscopía) con láser 532 nm de la próstata para el tratamiento de la hipertrófia/hiperplasia benigna de próstata. El aparato no está diseñado para tratar el cáncer de próstata. El sistema láser está destinado para incisión/escisión quirúrgica vaporización ablación hemostasis y coagulación de tejidos blandos. Se incluyen todos los tejidos blandos como la piel tejido cutáneo tejido subcutáneo tejido estriado y l', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7418, '5313510298', 'Esofagofibroscopio. Equipo flexible de fibra óptica para diagnóstico y tratamiento de enfermedades del esófago. Con las siguientes características seleccionables de acuerdo a las necesidades de las unidades médicas: diámetro externo diámetro de canal de trabajo longitud de trabajo ángulo de visión angulación arriba-abajo e izquierda-derecha.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7419, '5313530056', 'Espesímetro. Espesímetro metálico. Consta de los siguientes elementos: de aluminio de 3 mm de espesor con escala graduada de 40 cm (16 pulgadas) brazo deslizable sobre escala.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7420, '5313550013', 'Bisturí ultrasónico. Equipo quirúrgico portátil de ultrasonido para corte y coagulación. Consta de los siguientes elementos: generador de energía con frecuencia ultrasónica controlado por microprocesador; activador; pantalla con indicador de nivel de potencia y estado de operación; control de volumen de sonido y de potencia de trabajo. Las especificaciones de cada uno de los elementos señalados serán determinadas por las unidades médicas de acuerdo a sus necesidades.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7421, '5313560024', 'Equipo Robótico Para Re-Entrenamiento De Marcha. El equipo robótico para la marcha es una órtesis alimentada eléctricamente que consiste en un ajuste para la cadera y dos órtesis de marcha. Las órtesis están equipadas con un motor para la articulación de la cadera y otro para la articulación de la rodilla. Se monta en una puerta giratoria mediante un paralelogramo. Se utiliza junto a una cinta rodante y un sistema de soporte de peso corporal. Se controla mediante un PC.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7422, '5313570011', 'Equipo para terapia de heridas con presión negativa. Sistema electromecánico de uso hospitalario para la aplicación de presión negativa en heridas con el fin de promover la cicatrización mediante la generación de presión sub-atmosférica continua o intermitente. Consta de: bomba de control electrónico portátil; pantalla que muestre el estado y valores de operación o controles de membrana para monitorear el estado y los valores de operación; controles para ajustar la velocidad de instilación o irr', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7423, '5313590159', 'Espejo vaginal con adaptador para evacuación de humo. Auxiliar en los procedimientos electroquirúrgicos ginecológicos por vía vaginal con las siguientes características seleccionables de acuerdo a las necesidades de las unidades médicas: modelo Graves. Tamaño. Tubo metálico integrado a la valva anterior. Que permita la adaptación del tubo de aspirador al extremo distal. Aislamiento no conductivo de la electricidad. Esterilizable.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7424, '5313600014', 'Equipo para cifoplastía por balón. Equipo para el tratamiento de fracturas de cuerpos vertebrales que no responden al tratamiento conservador y presentan una deformidad que requiere corrección. Con las siguientes características: Jeringas. de inflado impactores óseos inflables Sistemas. iIntroductores Agujas. de acceso y Dispositivos de relleno. Cemento radiopaco de gran viscosidad (poli-metil-metacrilato con alto porcentaje de sulfato de bario) como material radiopaco de relleno y fijación del ', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7425, '5313610015', 'Espirómetro con neumotacógrafo.. Equipo portátil utilizado con fines diagnósticos a través de la medición de parámetros de la función respiratoria por método no invasivo. Controlado electrónicamente por microprocesador. Capacidad para conectarse a: computadora personal (interfase RS-232 o puerto paralelo) impresora externa. Pantalla para visualización de gráficas y resultados de las mediciones. Neumotacógrafo bidireccional reusable con: transductor de medición de flujo desde 14 L/seg hasta +14 L', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7426, '5313610098', 'Espirómetro tipo wrigth.. Equipo mecánico portátil para el diagnóstico a través de la medición de volumen corriente y volumen minuto por método invasivo en pacientes con patología que comprometen la función respiratoria. Fabricado de aluminio anodizado o bronce cromado. Medidor con dos escalas para: volumen de 0 a 15 litros con resolución de 1 litro flujo de 0 a 1000 ml/seg con resolución de 0.1 ml/seg. Capacidad para efectuar mediciones con un nivel de precisión de ± 4% en ambas escalas. Sistem', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7427, '5313610171', 'Espirómetro computarizado con neumotacógrafo.. Equipo para el diagnóstico de las alteraciones en la mecánica ventilatoria. Sistema que permite la realización de curvas volumen-tiempo y flujo-volumen con cálculo automático de 19 parámetros y comparación con valores normales; realización de análisis pre y post broncodilatadores; interpretación del estudio; almacenamiento de información en disco para análisis de tendencia; programas de calibración cálculo de parámetros comparación con valores norma', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7428, '5313610189', 'Ergoespirómetro en pruebas de ejercicio. Equipo electrónico digital para calcular parámetros cardiorrespiratorios en reposo y ejercicio programado con fines diagnósticos. Aparato en soporte o gabinete rodable con base para cilindros con computadora tipo PC para el cálculo automático de parámetros de ventilación en reposo y ejercicio programado. Incluye neumotacógrafo lineal de volumen analizador de oxígeno paramagnético analizador de bióxido de carbono infrarrojo neumotacógrafo transductores de ', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7429, '5313650017', 'Enteroscopio de doble balón. Equipo de enteroscopía de doble balón utilizado para la observación el diagnóstico y tratamiento del intestino delgado. Con las siguientes características seleccionables de acuerdo a las necesidades de las unidades médicas: Enteroscopio de doble balón de 8.5 a 9.4 mm de diámetro externo canal de trabajo de 2.2 a 2.8 mm ángulos de flexión de la punta arriba/abajo y derecha izquierda longitud total de al menos 2300 mm rango de observación de 5 100 mm como mínimo campo ', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7430, '5313750126', 'Estetoscopio de cápsula doble. Auxiliar para realizar auscultaciones en general. Consta de los siguientes elementos: Arco y auriculares. Ergonómico y diseñado para ajustarse a los oídos del usuario. Olivas lavables. Con tubo flexible. Cápsula doble para auscultación. Con sistema de rotación o giro para el cambio de cápsula. Membrana para cápsula con anillo de sujeción. Las especificaciones de cada uno de los elementos señalados serán determinadas por las unidades médicas de acuerdo a sus necesid', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7431, '5313750159', 'Estetoscopio de pinard.. Auxiliar que permite escuchar el latido fetal a través del útero y la pared abdominal de la mujer embarazada.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7432, '5313750209', 'Estetoscopio de cápsula sencilla. Auxiliar para medir la tensión arterial periférica y realizar auscultaciones en general no invasivo. Consta de los siguientes elementos: cápsula sencilla con arco y auriculares de acero inoxidable o bronce cromados ergonómico diseñado para ajustarse al oído del usuario olivas flexibles fabricadas de silicón o goma con rosca metálica lavables con tubo flexible de PVC largo de 45 a 56 cm cápsula para auscultación fabricada de acero inoxidable o bronce cromado con ', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7433, '5313800061', 'Electronistagmógrafo (reflejo vestíbulo ocular). Equipo para medición de reflejo vestíbulo-ocular activado por movimientos que realiza el paciente. Sistema computarizado de electronistagmografía para medición de reflejo vestíbulo-ocular por movimientos activos y pasivos de la cabeza. Integrado en un gabinete que incluye computadora con programa adecuado y teclado que permite identificar al paciente y seleccionar el estudio. Consta de monitor e impresora que registra los resultados así como banda', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00');
INSERT INTO `catalogo_material` (`id`, `clave`, `descripcion`, `unidad`, `cantidad`, `tipo`, `caracteristicas`, `redfrio`, `fecha_registro`) VALUES
(7434, '5313800087', 'Electronistagmógrafo (estímulo oído interno). Equipo para registro de movimientos oculares en relación a estímulos en el oído interno para la exploración de la función vestibular. Sistema de electronistagmografía de 2 ó 4 canales con amplificador de corriente alterna/corriente directa diferenciador y sistema de calibración (regla de Brany). En base rodable o consola. Incluye silla de torsión pendular activada por resortes y con diferentes posiciones así como electrodos e implementos indispensabl', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7435, '5313800103', 'Electroestimulador de alto voltaje corriente pulsátil y detección. Equipo que se utiliza para aplicar corriente de alto voltaje en tratamientos de puntos dolorosos y estimular la función neuromuscular. Electroestimulador de alto voltaje de frecuencia baja y corriente directa controlado por microprocesador con pantalla de cristal líquido que muestre los parámetros. Con ajuste de contraste. Con dos canales independientes para estimulación con opción de almacenar al menos cinco tratamientos. Forma ', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7436, '5313800137', 'Estimulador neuromuscular de corriente interferencial sin sistema de vacío. Equipo fijo a carro para terapia interferencial en la rehabilitación del paciente con afecciones neuromusculares. Con las siguientes características seleccionables de acuerdo a las necesidades de las unidades médicas: corriente interferencial premodulada sin sistema de vacío control de duración e intensidad del estímulo; selector de tiempo de tratamiento; control manual o digital de corriente. Frecuencia de acarreo frecu', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7437, '5313800145', 'Estimulador tens. Equipo electro estimulador transcutáneo de función neuromuscular portátil. Con las siguientes características seleccionables de acuerdo a las necesidades de las unidades médicas: canales de salida con frecuencia de pulso e intensidad programable. Que funciona con corriente eléctrica o baterías recargables corriente de estimulación máxima.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7438, '5313800806', 'Electroestimulador neuromuscular de bajo voltaje y corrientes diadinámicas. Equipo para tratamiento de dolor y estimulación de la función neuromuscular. Con las siguientes características seleccionables de acuerdo a las necesidades de las unidades médicas: electroestimulador de bajo voltaje de corriente directa y frecuencia baja. Controlado por microprocesador. Canales de tratamiento. Modalidades de estimulación eléctrica tratamientos programados y capacidad de almacenar tratamientos. Indicador ', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7439, '5313800905', 'Electronistagmógrafo (optoquinético y vestibular). Equipo para exploración de la función vestibular con análisis de las respuestas. Sistema de electronistagmografía capaz de efectuar análisis computarizado de nistagmus optoquinético y vestibular pruebas posicionales análisis aleatorio de sacadas y análisis complejo de electro oculografía de 2 4 ó 6 canales. Integrado en una consola que permite la programación de los estudios y la identificación del paciente. Consta de impresora silla rotatoria a', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7440, '5313800913', 'Generador terapéutico de corrientes diadinámicas. Equipo para estimular la función neuromuscular. Estimulador con cuatro tipos de corrientes diadinámicas: difásica monofásica cortos periodos y largos periodos. Corriente 2-5 (de acuerdo con Trabert). Corriente directa de baja frecuencia (galvánica) y secuencia de pulsos triangulares con selector de 15 programas. Cable de conexión al paciente de dos salidas con electrodos integrados incluyendo placa.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7441, '5313800921', 'Estimulador cardíaco. Equipo generador de pulsos eléctricos externos portátil para la inducción y/o separación de taquicardias con cable con salidas conectoras a electrodos. Cable conector a tierra. Capacidad de estimulación a frecuencia cardiaca fija. Capacidad de estimulación a frecuencias de estimulación fijas. Secuencia de estimulación. Programada en tiempo de descarga con reducción en tiempo de descarga. Capacidad de introducir extraestímulos en forma programable. Umbrales de estimulación p', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7442, '5313800954', 'Estimulador de nervios periféricos. Equipo portátil utilizado para valorar el nivel de relajación muscular a través de la aplicación de corriente eléctrica directa y controlada para producir estimulación de las terminaciones nerviosas en pacientes bajo los efectos de anestesia general con el propósito de valorar el nivel de relajación muscular. Principio de funcionamiento electrónico. Que opere con batería alcalina de 9 Volts. Con controles para encendido y apagado. Estímulos: único y tetánico t', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7443, '5313800962', 'Neuroestimulador para localización de nervios periféricos. Equipo portátil utilizado para localizar nervios periféricos mediante estimulación. Consta de: estimulador con pantalla; alimentado por batería; con ajuste de frecuencia mA y resolución regulador de corriente electrodos. Las específicaciones de cada uno de los elementos señalados serán determinados por las unidades médicas de acuerdo a sus necesidades.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
