(7513, '5314800102', 'Humidificador de intercambio calor - humedad tipo cascada electrónico. Equipo para sustituir la función de las vías respiratorias en cuanto a calentar el aire inspirado y proporcionarle humedad. Humidificador de tipo cascada servocontrolado con control electrónico temperatura graduable y alarmas programables de alta y baja temperatura.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7514, '5314800128', 'Humidificador con calefacción. Humidificador para sustituir la función de las vías respiratorias para calentar y proporcionar humedad al aire inspirado al utilizar ventilador adulto y pediátrico. Humidificador térmico con microprocesador de doble servo en la cámara y en la salida del paciente que provee temperatura y nivel de humedad estables aún con cambio en el flujo de gas. Con carátula digital que continuamente muestra en la misma pantalla las temperaturas del gas y de la cámara. Con selecci', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7515, '5314800193', 'Humidificador de intercambio calor-humedad tipo cascada. Humidificador para substituir la función de las vías respiratorias en cuanto a calentar el aire inspirado y proporcionarle humedad. Humidificador de arrastre tipo cascada con control de temperatura graduable para adaptarse a ventiladores mecánicos o volumétricos. Alarmas de alta y baja temperatura.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7516, '5314800201', 'HUMIDIFICADOR CON CALEFACCIÓN Y GENERADOR DE FLUJO INTEGRADO. Humidificador con generador de flujo y medidor de oxígeno integrados, para proporcionar gases respiratorios calientes y humidificados de alto flujo a pacientes con respiración espontánea. Con pantalla con gráficos que muestre temperatura, flujo y FiO2, así como mensajes de alarma y ciclos de desinfección. Modo Adulto con: control de temperatura de 31°C, 34°C y 37°C, control de velocidad de flujo de 10 a 60 l/min, capacidad de programa', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7517, '5314930073', 'Impresora blanco y negro láser en seco. Equipo para imprimir en seco imágenes radiográficas en película. Impresora en seco láser blanco y negro. Que imprima en formato 35.56 cm x 43.18 cm(14 x 17 pulgadas). Impresión con calidad diagnóstica.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
