(7519, '5314930099', 'Impresora blanco y negro y color por sublimación térmica en seco. Equipo para imprimir en seco imágenes radiográficas en película. Impresora en seco blanco y negro y color que utiliza técnica de sublimación térmica. Que imprima en formato 20.32 cm x 25.4 cm (8 x 10 pulgadas). Impresión con calidad diagnóstica. Con resolución de al menos 300 puntos por pulgada y resolución de contraste de al menos 256 niveles de gris y un mínimo de 16 millones de colores.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7520, '5314950022', 'Incinerador de Agujas. Hipodérmicas. Equipo eléctrico portátil para destruir Agujas. Hipodérmicas mediante altas temperaturas. Utiliza corriente eléctrica de bajo voltaje. Con las siguientes características seleccionables de acuerdo a las necesidades de las unidades médicas: Temperatura de operación. Dimensiones. Cartucho. Fuente de poder. Indicador de llenado. Contenedor.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
