(7524, '5314972095', 'Incubador-autolector para esterilización con vapor. Equipo que permite monitorear los procesos de esterilización con vapor a través de la incubación y lectura de indicadores biológicos. Controlado por microprocesador; lectura de fluorescencia del indicador biológico en un lapso menor a tres horas. Con doce pozos para incubación y lectura y dos pozos de activación. Con cronómetro. Indicadores luminosos de lectura.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7525, '5314972108', 'Incubador-autolector para esterilizacion con oxido de etileno. Equipo que permite monitorear los procesos de esterilización con gas de óxido de etileno a través de la incubación y lectura de indicadores biológicos. Controlado por microprocesador; lectura de fluorescencia del indicador biológico en un lapso menor a cuatro horas. Con doce pozos para incubación y lectura y dos pozos de activación. Con cronómetro. Indicadores luminosos de lectura.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
