(7635, '5316140408', 'Medidor de ph esofágico. Monitor ambulatorio de pH esofágico. Sistema de monitoreo ambulatorio de ph esofágico que consta de una unidad portátil ajustable a la cintura para pacientes ambulatorios con botones de acceso simple para el paciente. Capacidad de descarga inalámbrica de datos. Entrada de 1 a 3 canales  con rango de medición de 1.0 a 8.0 ph con capacidad de grabación de al menos 24 horas. Con analizador de síntomas y capacidad de cálculo de índices (De Meester y pediátrico de Boix-Ochoa)', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7636, '5316140424', 'Estadímetro pediátrico.. Equipo para la medición de la longitud de niños menores de 2 años. Con las siguientes características seleccionables de acuerdo a las necesidades de las unidades médicas: colchoneta portátil hipoalergénica flexible con dispositivo para colgar. Con tope fijo para la cabeza y tope móvil para los pies. Rango de medición con divisiones con escala numérica en centímetros y milímetros.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7637, '5316140435', 'Dispositivo de Medición de conducción nerviosa. Dispositivo ergonómico manual alimentado por una batería cuenta con biosensores para uso de un solo paciente que están previstos para medir señales neuromusculares que son útiles en el diagnóstico y evaluación de neuropatías sistemáticas y de aprisionamiento midiendo la velocidad de conducción del nervio sural y la amplitud de potencial de acción del nervio sensorial. Es un dispositivo de base multiprocesadora de señal mixta que interactúa con un b', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7638, '5316160034', 'Mesa para lavado de pacientes. Equipo fijo para realizar el baño y curación de pacientes quemados. Mesa de acero inoxidable. Con columna fija a piso. Con accionamiento mecánico hidráulico de altura ajustable. Accionada por pedal. Longitud útil de 250 cm + 5%. Tarja integrada a la sección de pies de 35 a 50 cm de largo. Con sistema de flujo de agua fría y caliente al nivel de la superficie. Regadera con extensión para irrigación a lo largo de la mesa. Drenaje dispuesto lateralmente. Con charolas ', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7639, '5316160125', 'Mesa ortopédica infantil. Mesa ortopédica infantil tipo Bernstein de aluminio anodizado altura y longitud ajustable con soporte pélvico.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7640, '5316160166', 'Mesa inclinable. Mesa utilizada para la reeducación del mecanismo de balance afectado por largos periodos en cama y la rehabilitación funcional. Con las siguientes características seleccionables de acuerdo a las necesidades de las unidades médicas: Mesa electromecánica medidas consola de mando electromecánico mesa de trabajo con inclinación graduable con indicador de ángulo seleccionados desmontable base rodable con sistema de frenado con bandas de sujeción tablero para pies.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7641, '5316160463', 'Mesas. Mesa para autopsias con preparación para triturado de acero inoxidable drenaje central de sobreflujo hidroaspirador con flujo reversible ruptor de vacío charolas de acero inoxidable desmontables ajustador hidráulico aspersores manuales con válvulas de control. Sistema de flujo de agua a nivel de la superficie para irrigación de la mesa que permita retirar fluidos y residuos. Graduación en centímetros en la parte lateral y frontal. Accesorios: Triturador.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7642, '5316160679', 'Mesa mayfield larson. Mesa Mayfield larson. Contener organizar y disponer de instrumental durante neurocirugía.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7643, '5316160976', 'Mesa quirúrgica universal mecánico-hidraúlica Mesa para facilitar el procedimiento quirúrgico con posiciones adecuadas para el paciente y el cirujano. Características generales: Mesa mecánico hidráulica rodable. Que soporte un peso de 160 Kg como mínimo. Con sistema de frenos. Longitud total con extensión de cabecera y piernas de 210 cm +/- 10 cm. Base con cubierta de acero inoxidable o acero al cromo níquel o polímero resistente al alto impacto. Cubierta de la columna en acero inoxidable o acer', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7644, '5316165066', 'Mesa para tratamiento fisiátrico. Mesa de madera. Consta de los siguientes elementos: forrada dimensiones abatible con inclinación. Material de armazón y de cubierta de patas. Las especificaciones de cada uno de los elementos señalados serán determinadas por las unidades médicas de acuerdo a sus necesidades.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7645, '5316165082', 'Mesa de exploración proctológica. Mesa para facilitar la exploración y realizar los estudios y procedimientos proctológicos. Con las siguientes características seleccionables de acuerdo a las necesidades de las unidades médicas: mesa con base columna y rieles laterales. Tablero giratorio. Longitud total con extensión de cabecera y piernas. Con mínimo dos secciones de: cabecera y dorso pelvis y miembros pélvicos abatibles. Acción electro-hidráulica de movimientos: elevación y descenso Trendelembu', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7646, '5316165108', 'Mesa quirúrgica universal electrohidraúlica. Mesa para facilitar el procedimiento quirúrgico con posiciones adecuadas para el paciente y el cirujano. Mesa para facilitar el procedimiento quirúrgico con posiciones adecuadas para el paciente y el cirujano. Características generales: Mesa electrohidráulica rodable. Controlada por microprocesador. Que soporte un peso de 160 Kg como mínimo. Con sistema de frenos. Longitud total con extensión de cabecera y piernas de 210 cm +/- 10 cm. Base con cubiert', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7647, '5316165116', 'MESA QUIRÚRGICA UNIVERSAL AVANZADA. Mesa para facilitar el procedimiento quirúrgico con posiciones adecuadas para el paciente y el cirujano. Mesa electrohidráulica rodable. Controlada por microprocesador. Que soporte un peso de 220* Kg como mínimo. Con sistema de frenos. Longitud total con extensión de cabecera y piernas de 210 cm +/- 10 cm. Base con cubierta de acero inoxidable o acero al cromo níquel o polímero resistente al alto impacto. Cubierta de la columna en acero inoxidable o acero al c', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7648, '5316165124', 'Mesa radiotransparente para arco quirúrgico en c estándar. Mesa para sistema móvil de imagenología a través de fluoroscopía para procedimientos vasculares con las siguientes características seleccionables de acuerdo a las necesidades de las unidades médicas: Rodable. Distancia mínima para la colocación del arco en C entre cualquier estructura de la base de la mesa y el tablero. Altura ajustable. Tablero flotante de fibra de carbón. Movimientos manuales: longitudinal transversal capacidad de ', 'PZA', '1', 'PZA', 'generico', 'NO', '0000-00-00 00:00:00'),
(7649, '5316180040', 'Monitor de electrocardiografía. Equipo portátil para registro continuo gráfico y visual de ritmo y frecuencia cardiaca. Monitor electrónico digital portátil de ritmo y frecuencia cardiaca con unidad de registro electrocardiográfico. Alarmas programables de alta y baja frecuencia funciona con corriente alterna y batería recargable.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7650, '5316190056', 'Monitor de radiación. Monitor de pared para vigilancia de los niveles de radiación gama y detección de los mismos al exceder los límites permisibles para el usuario. Consta de los siguientes elementos: despliegue del nivel de radiación gama en código de luces de colores. Alarmas audibles y visibles. Control ajustable. Niveles de indicadores de disparo. Batería con cargador. Las especificaciones de cada uno de los elementos señalados serán determinadas por las unidades médicas de acuerdo a sus ne', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7651, '5316190205', 'Monitor para Ventilador. Adulto. Equipo para registro y control de la mecánica pulmonar en pacientes con ventilación asistida. Monitor que realiza la medición a través de transductores de presión diferencial temperatura y presión de la vía aérea. Calcula volumen corriente frecuencia respiratoria ventilación minuto delta de la presión esofágica trabajo respiratorio del paciente y del ventilador presión tiempo índice de presión tiempo máximo de presión inspiratoria distensibilidad dinámica y estát', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7652, '5316190270', 'Monitor para ventilador. Pediátrico. Equipo para registro y control de la mecánica pulmonar en pacientes pediátricos con ventilación asistida. Monitor que realiza la medición a través de transductores de presión diferencial temperatura y presión de la vía aérea. Calcula el volumen corriente frecuencia respiratoria ventilación minuto delta de la presión esofágica trabajo respiratorio del paciente y del ventilador; presión tiempo índice de presión tiempo máximo de presión inspiratoria distensibili', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7653, '5316190288', 'Monitor de presión arterial. Equipo para registro gráfico visual de presión arterial y pulso por método no invasivo. Monitor digital de corriente alterna y batería recargable para registro de la presión arterial por método no invasivo. Alarmas programables de máxima y mínima; registro de pulso pantalla indicadora de presión sistólica media y diastólica mediante oscilometría.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7654, '5316190387', 'Monitor de bióxido de carbono espirado. Aparato para el registro continuo de bióxido de carbono espirado y de la saturación de oxígeno en sangre por método no invasivo para controlar pacientes en estado crítico. Analizador de bióxido de carbono que realiza capnografía y capnometría por absorción de rayos infrarrojos analiza lectura del porcentaje de oxígeno en sangre de 0 a 100% y del CO2 en el aire espirado. Mide la producción de CO2 por minuto la ventilación efectiva e inefectiva y permite gra', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7655, '5316190403', 'Monitor de signos vitales. Equipo invasivo y no invasivo que registra en pantalla las constantes vitales del paciente con fines diagnósticos y terapéuticos. Con las siguientes características seleccionables de acuerdo a las necesidades de las unidades médicas: monitor configurado o modular con pantalla. Con capacidad para conectarse a red de monitoreo. Pantalla para presentación de curvas fisiológicas simultáneas e información numérica para los siguientes parámetros: Electrocardiograma en deriva', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7656, '5316190411', 'Monitor de signos vitales para el traslado del paciente. Equipo portátil no invasivo que registra en pantalla las constantes vitales del paciente con fines diagnósticos y terapéuticos. Con las siguientes características seleccionables de acuerdo a las necesidades de las unidades médicas: monitor. Con asa para transporte y sistema para sujeción a rieles laterales de camilla. Controlado por microprocesador. Para presentación simultánea de curvas fisiológicas e información numérica para los siguien', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7657, '5316190429', 'Monitor de electrocardiografía portátil. Monitor portátil para la visualización del registro electrocardiográfico y la frecuencia cardiaca. Equipo portátil compacto con dimensiones de 191 x 102 x 41 mm y peso de 300 g formado por un teclado plano de membrana un cristal líquido. Tiene incorporado electrodos fijos; así como un conector que permite su utilización con un cable de electrodos convencionales. Alimentación por baterías.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7658, '5316190452', 'Monitor transoperatorio. Equipo electromédico para la vigilancia de múltiples parámetros electrocardiográficos y hemodinámicos durante la administración de gases anestésicos. Monitor modular con capacidad de despliegue de ocho curvas. Pantalla de alta resolución de 15\" como mínimo a color de cristal liquido o TRC. Memoria para tendencias gráficas y numéricas con un mínimo de 24 horas. Módulos para vigilar los siguientes parámetros Electrocardiograma en tres derivaciones simultáneas con análisis ', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7659, '5316240026', 'Microscopio para oftalmocirugía. Auxiliar en las intervenciones quirúrgicas de oftalmología. Columna -estativo rodable con sistema de frenado. Brazo articulado compensado y de contrabalanceo. Sistema de movimiento XY motorizado con botón de puesta a cero o precentrado automático. Sistemas. zoom (relación 1: 6) y de enfoque fino motorizados. Tubo binocular oblicuo con dispositivo de observación simultánea con óptica apocromática. Oculares de 10X o 12.5X gran angulares con ajuste de ametropías. Ob', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7660, '5316260016', 'Microscopio para otorrinolaringocirugía.. Equipo para visualización microscópica de las estructuras de la nariz oído y garganta. Consta de los siguientes elementos: brazo giratorio estativo y brazo basculante de autocompensado; sistema que permita múltiples posicionamientos; cambiador manual de aumentos; enfoque fino; tubo binocular recto e inclinable; ópticas con ajuste de dioptrías; campo amplio; objetivos para distancia de trabajo con óptica de gran campo; sistema modular que permita adaptar ', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7661, '5316260024', 'Microscopio para neurocirugía. Equipo rodable no invasivo de precisión en microscopía utilizado como auxiliar en el tratamiento quirúrgico. Microscopio de cuerpo compacto que permita la fácil y rápida integración y conversión del sistema para su uso específico o en la especialidad de Neurocirugía. Estativo de piso de base compacta montado sobre ruedas que permiten el fácil desplazamiento con sistema de frenado. Desplazamiento del microscopio en forma ágil y precisa en cualquier posición deseada ', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7662, '5316260031', 'Microscopio especular banco de ojos. Equipo médico indicado para medir la densidad celular endotelial de la superficie corneal y espesor de la córnea (paquimetría). Cuenta con un sistema integrado de análisis celular que determina en forma rápida y precisa el conteo de las células para el análisis de córnea del donador y su uso en trasplantes. Cuenta con dos cámaras digitales CMOS interconstruidas. Modo de captura de la imagen manual o automático. Iluminación para la captura de la imagen por fue', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7663, '5316260040', 'Microscopio para exploración en otorrinolaringología.. Equipo de diseño mecánico rodable con estativo multiposicional para realizar exploración. Estativo móvil con sistema de frenado. Tubo binocular estereoscópico recto con óptima acromática oculares 10 X o mayor con ajuste para operadores con gafas lentes objetivos para tres distancias de trabajo en el rango de 200 a 400 mm con selector de aumentos ajuste manual de enfoque fino. Conductores de luz por fibra óptica o iluminación coaxial integrad', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7664, '5316260081', 'Microscopio para cirugía reconstructiva.. Equipo electromédico de diseño mecánico rodable con estativo multiposicional. Soporte rodable con sistema de frenado. Brazo articulado equilibrado tubo binocular multiposicional de ángulo variable. Pedal para control remoto de funciones. Optica de gran angular de 3 a 5 aumentos. Enfoque fino motorizado. Filtro exento de rojo. Oculares de 10X o 12.5X 15X o 16X con ajustes de ametropías y conchas abatibles. Objetivos de óptica apocromática para distancia d', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7665, '5316260099', 'Microscopio quirúrgico básico.. Equipo electromédico rodable que se utiliza como apoyo en el diagnóstico y tratamiento de las diferentes patologías de imágenes microscópicas y/o microquirúrgicas por métodono invasivo. Sistema articulado por brazos contrabalanceados. Con columna de base rodable y frenos. Panel de control manual. Interruptor para iluminación. Regulación de luminosidad. Pedal para control remoto de funciones. Optica de gran angular de 3 a 5 aumentos. Enfoque fino motorizado. Ocular', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7666, '5316260107', 'Videomicroscopio. Videomicroscopio (Microscopio con circuito cerrado de televisión). Instrumento óptico de apoyo con fines de diagnóstico para todo tipo de patologías detectadas microscópicamente. Oculares de 12.5x de campo visual amplio que permiten la observación a los usuarios. Tubo binocular inclinable a 45 ° (girable a 360 °). Revolver para cuatro objetivos. Objetivos acromáticos de 2.5 X 10 X40 X y 100 X. Platina provista de carro con movimiento en cruz. Condensador con apertura numérica d', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7667, '5316260115', 'Microscopio quirúrgico oftalmológico avanzado. Equipo electromédico rodable que se utiliza como apoyo en el diagnóstico y tratamiento de las diferentes patologías de imágenes microscópicas y/o microquirúrgicas por método no invasivo es utilizado por el médico cirujano en unidades de tercer nivel de operación. Columna-estativo rodable con sistema de frenado brazo articulado y autocompensado que permite el libre fácil y sólido posicionamiento del microscopio accionado por servo o electromotores. S', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7668, '5316260123', 'Microscopio para oftalmocirugía de alta especialidad. Equipo rodable no invasivo de precisión en microscopía oftalmológica empleado como auxiliar en el tratamiento quirúrgico. Columna-estativo rodable con sistema de frenado. Brazo articulado y compensado que permite el libre fácil y sólido posicionamiento del microscopio. Con sistema de ajuste de equilibrio. El estativo debe permitir conectar la lámpara de hendidura y sistema XY. Sistema de movimiento XY con botón de puesta a cero o precentrado ', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7669, '5316320018', 'Monitor de perfusión sanguínea. Equipo no invasivo para seguimiento de perfusión sanguínea en tiempo real con cálculos simultáneos de velocidad volumen flujo sanguíneo y temperatura. Aparato con sistema de fibra óptica que libera un haz de luz láser de baja potencia (2.0 mW típica y 2.5 mW máxima) al tejido; las células rojas en movimiento imparten una variación de frecuencia efecto doppler a los fotones. Un par de fibras ópticas en el mismo transductor colectan las señales de luz que llevan inf', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7670, '5316320554', 'Central de monitoreo para múltiples camas. Sistema de vigilancia de constantes vitales Con las siguientes características seleccionables de acuerdo a las necesidades de las unidades médicas: que opere por microprocesador fijo que requiere de instalación eléctrica e interconexión entre los elementos que lo integran. Para documentar los parámetros con software y alarmas que requieran las unidades médicas. Teclado alfanumérico y ratón. Impresora láser. Monitores modulares de cabecera.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7671, '5316350114', 'Electromotor para cirugía. Aparato eléctrico para realizar micro y macro cirugía ósea. Motor electroquirúrgico con marcha a la derecha o con marcha a la derecha y a la izquierda. Sistemas. De refrigeración e irrigación integrados. Utiliza macro y/o micro ejes flexibles para piezas de mano. Unidad de mando por pedal para la regulación de la velocidad de rotación y compulsadores para cambiar la marcha de derecha a la marcha de izquierda así como para conectar y desconectar el sistema de refrigerac', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7672, '5316350122', 'Motor neumático compacto. Aparato de impulsión neumática para instrumentos utilizados en cirugía ortopédica y traumatológica que funciona con Nitrógeno. Consta de: Motor con regulación continua de la velocidad que permite la inversión en sentido de la marcha sin interrumpir el trabajo. Velocidad variable dentro del rango de seguridad en r.p.m. Consumo de gas en l/min. Presión de funcionamiento de 6 a 10 atm o su equivalente en psi o en bar. Manguera doble de 2 a 5 m. de longitud.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7673, '5316350130', 'Motor neumático micro. Aparato de impulsión neumática para instrumentos utilizados en cirugía de huesos cortos que funciona con Nitrógeno. Consta de: Motor con velocidad de operación variable. Peso no mayor a 250 gr. Consumo de gas no mayor a 230 l/min. Presión de funcionamiento no mayor a 6-8 atm o su equivalente en psi o en bar. Manguera de doble conducción e interruptor de palanca ubicada en el cuerpo de la pieza de mano.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7674, '5316410082', 'Nebulizador con dosificador de oxígeno. Equipo eléctrico y neumático que genera partículas de vapor para proporcionar aire en condiciones de humedad temperatura y oxígeno controlado Con las siguientes características seleccionables de acuerdo a las necesidades de las unidades médicas: nebulizador de reservorio reutilizable y desarmable en todas sus partes. Con capacidad para suministrar humedad y aerosolterapia. Cabeza y sistema de nebulización. Tamaño de partículas. Válvula de seguridad para so', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7675, '5316410207', 'Nebulizador ultrasónico contínuo. Equipo portátil para aerosolterapia con sistema de sonido de alta frecuencia para producir aerosol. Con las siguientes características seleccionables de acuerdo a las necesidades de las unidades médicas: aparato eléctrico para trabajo continuo. Cámara de acoplamiento con transductor para la generación de partículas finas flujo de salida regulable en ml/h. Sistema automático de alimentación de agua. Interruptor de operación sin agua con alarma visual. Cámara de n', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7676, '5316410215', 'Nebulizador ultrasónico intermitente. Equipo para aplicar terapia en aerosol a pacientes con enfermedad obstructiva o con problema en el manejo de las secreciones broncopulmonares. Nebulizador para trabajo intermitente con generación de niebla fría y partículas finas para aplicación de aerosoles. Dotado con sistema automático de alimentación de agua secador de Tubos. y aditamentos. Tienda de plástico estructura de soporte para tienda de plástico y carro de transporte.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7677, '5316410397', 'Nebulizador sin elemento térmico. Equipo eléctrico y neumático móvil que genera partículas de vapor para proporcionar aire en condiciones de humedad y oxígeno controlados por método no invasivo. Nebulizador de reservorio reusable y desarmable en todas sus partes. Con capacidad para suministrar humedad y aerosolterapia. Cabeza de nebulización. Con sistema de nebulización. Con válvula de seguridad. Con conector neumático. FiO2 regulable. Filtro reusable y esterilizable. Flujo nominal. Jarra reusab', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7678, '5316480015', 'Navegador sistema de imagen guiada para cirugía de hueso. Sistema de Imagen guiada para Cirugía que provee información intraoperatoria a los ciruganos a través de una imagen en 2da. dimensión (2D) y 3ra dimensión (3D) que se puede actualizar durante el transoperatorio. El sistema genera un plan quirúrgico e interactivo de localización y digitalización que guía al cirugano a través de técnicas de navegación. Navegador y sistema de planeación con: sistema de referencia o posicionamiento del pacien', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7679, '5316560118', 'Oclusor. Oclusor para valorar agudeza visual. Instrumento médico fabricado con un material derivado del estireno necesario durante la exploración de la agudeza visual para ocluir el ojo contralateral al que explora así como para la detección eficaz de estrabismo. Pantalla redonda sencilla. Longitud en el rango de 25 cm X 7 cm. Color negro.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00');
