(7680, '5316600096', 'Oftalmoscopio binocular indirecto. Oftalmoscopio binocular indirecto. Sistema de óptica sellado. Cabezal ajustable en perímetro y altura. Ajuste de distancia interpupilar. Filtro azul para angioscopía fluorescente y filtro exento de rojo. Lente anesférico de cristal de +20 dioptrías. Lámpara de halógeno. Depresor esclera. Ajuste de ángulo de espejo de reflexión. Dispositivo de prisma para enseñanza. Control de intensidad de luz. Estuche para guarda. Consume: Tarjetas para diagnóstico de fondo y ', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7681, '5316610061', 'Topógrafo corneal.. Aparato para realizar mapeo tridimensional de la superficie corneal. Unidad que consta de queratoscopio de 23 anillos área de medida 0.46 - 1.0 mm. Rango de poder de 18 a 95 dioptrías. Videocámara ccd de alta resolución. Procesador de 483 / 66 MHz disco duro de 270 megabytes disco suave de 1.44 megabytes. Monitor de 14 . Mesa eléctrica basculable para queratoscopio. Mesa para topógrafo. Funda cubrepolvo.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7682, '5316610079', 'Unidad de facoemulsión. Aparato para extracción de catarata por facofragmentación y vitrectomía anterior. Unidad que consta de: pieza de mano de ultrasonido para facoemulsificación; pieza de mano i/a de punta intercambiable; punta con puerto de 0.3 mm curva de i/a; punta con puerto de 0.3 mm a 90 ° de i/a. Pedal de tecnología avanzada. Cabeza de ocutomo de vitrectomía anterior. Punta de facoemulsificación de 30 °. Juego de tubería.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7683, '5316610087', 'Unidad oftalmológica.. Unidad médica fija con soportes iluminación y aditamentos para diagnóstico y tratamiento de patologías oftalmológicas. Sillón electrohidráulico: Giratorio 180 ° como mínimo. Reclinable. Apoya brazos abatibles. Cabezal ajustable. Descansapies. Conectado a panel de control y a interruptor de pie. Panel o consola de control con los siguientes controles como mínimo: Elevador de silla. Encendido y control de intensidad de lámpara. Con tres fosos portainstrumentos. Columna con l', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7684, '5316670065', 'Oxímetro de pulso. Portátil. Equipo portátil para registro y control continuo del nivel de saturación de oxígeno en la sangre y la frecuencia del pulso con fines diagnósticos y terapéuticos. Equipo portátil para la medición del nivel de saturación de oxígeno en un dedo o multisitio y con registro del pulso. Despliegue digital de: porcentaje de saturación de oxígeno en sangre con intervalo de 0 a 100%. Frecuencia de pulso dentro del rango de 18 a 300 pulsos por minuto. LED o barra de color para i', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7685, '5316670081', 'Oximetro de Pulso. Equipo para la medición y el registro continúo de la saturación de oxígeno en sangre periférica. Con las siguientes características seleccionables de acuerdo a las necesidades de las unidades médicas: Despliegue digital en pantalla de porcentaje de saturación de oxígeno en sangre. Frecuencia cardiaca. Curva de pletismografía. Tendencias de saturación de oxígeno. Memoria para almacenamiento de datos. Sistema de alarmas audibles y visibles ajustables. Teclado. Volumen para tono ', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7686, '5316690022', 'Osteotomo neumático. Equipo con turbina de velocidad media con alta torsión para cortar rimar (fresar) esculpir y perforar huesos cortos mediante corte oscilatorio sagital y reciprocante. Consta de: pieza de mano turbina (impulsor neumático para microfragmentos). Velocidad de operación en r.p.m. Regulador de velocidad. Presión de funcionamiento en atm psi y bar. Consumo de aire en l/min. Guarda o aditamento para perforardor de microfragmentos. Guarda o aditamento para protector de tejidos. Perfo', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7687, '5316700060', 'Unidad otorrinolaringológica. Unidad fija integrada por aditamentos necesarios para el diagnóstico y tratamiento de problemas otorrinolaringológicos. Unidad integrada por consola para fuente de energía y control de instrumentos que consta de: Atomizador de polvos. Atomizador para solución acuosa. Atomizador para solución aceitosa. Unidad de succión. Soporte para equipo microcauterizador o cauterizador. Tablero integrado a la consola para instrumentos. Sistema de calentamiento para soluciones por', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7688, '5316740017', 'Peritoneoscopio. Equipo portátil invasivo utilizado para la implantación adecuada del catéter peritoneal blando en pacientes de los programas de diálisis peritoneal ambulatorio. Lente endoscópica de 2.2 * 1 mm de diámetro. Longitud de 300 mm. Angulo de visión de treinta grados. Con entrada para guía de luz. Fuente de luz fría de halógeno de mínimo 150 watts. Ajuste de intensidad de luz. Con guía de luz de fibra óptica integrada. Con lámpara auxiliar integrada intercambiable vía interruptor o aut', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7689, '5316780013', 'Plicómetro. Auxiliar para medir el grosor de la grasa subcutánea con fines de valoracion nutricional. Consta de los siguientes elementos: de aluminio anticorrosivo o acero inoxidable resolución de 0.20 mm rango de apertura de 50 mm calibrado para ejercer una presión constante de 10 g/mm 2 ± 10% calibrador de acero inoxidable.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
