(7691, '5316920023', 'Pistola para toma de biopsias. Instrumento automático para toma de biopsias. Instrumento con mecanismo automático de 12 cm de longitud y 250 g de peso aproximadamente. Presión de disparo de 5.3 libras/pulgada3. Se le adaptan Agujas. para biopsia con diámetros de 14 a 20 gauge y longitudes de 10 a 30 cm. Profundidad de penetración seleccionable de 15 o 22 mm.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7692, '5316950061', 'Portamandiles. Portamandiles empotrable para sostener mandiles emplomados. Consta de los siguientes elementos: Con capacidad para 5 mandiles emplomados. Con fijación a muro. Gancho tubular con acabado al cromo orientables que soporte hasta 110 Lb de peso. Las especificaciones de cada uno de los elementos señalados serán determinadas por las unidades médicas de acuerdo a sus necesidades.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7693, '5316980019', 'Plantoscopio de estructura metálica (acero inoxidable o aluminio) o plástico resistente al alto impacto con cubierta de vidrio templado biselado de 9 mm. de espesor o mayor que permita la colocación de ambos pies (no menor de 25 x 35 cm.) con espejo móvil que permita visualizar la superficie plantar de ambos pies con iluminación fluorescente interna con control de apagado y encendido.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
