(7695, '5317020013', 'Polígrafo del tracto digestivo. Equipo para medir motilidad del tracto digestivo presiones esofágicas y anorrectales electromiografía y retroalimentación biológica. Aparato medidor (unidad base) de 1 hasta 16 canales de grabación configurables para medir presión electromiografía electrogastrografía pH respiración y trago. Con display de \"LEDS\" luminosos para verificación rápida de funcionamiento. Con resolución de 12 bits. Comunicación serial óptico RS 232. Compatible para ser usado con Catétere', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7696, '5317025944', 'Pinza Allis con 5 x 6 dientes longitud de 250 a 260 mm.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
