(7698, '5317090016', 'Revelador de películas de 35 mm. Equipo portátil diseñado especialmente para procesar películas de cinefluorangiografía de 35 mm. Enhebrado automático de la película. Revelado con luz ambiental o luz de día. Tiempo total de procesamiento de la película de 9 minutos o menor. Velocidad de procesamiento seleccionable de 4 a 21 metros por minuto o más. Control electrónico de la temperatura. Que permita cortar y embobinar automáticamente la película.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7699, '5317090024', 'Revelador automático para radiografías. Equipo para revelar en forma automática películas radiográficas con las siguientes características de acuerdo a las necesidades de las Unidades Médicas: Cantidad y tamaño de películas procesadas y secas en un tiempo determinado. Sin consumo de agua en tiempo de espera. Funciones controladas por un microprocesador. Modo de espera (stand by). Con panel de control y despliegue digital. Con sistema de secado de películas. Con tanques para revelador fijador y a', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7700, '5317140076', 'Proyector de optotipos. Proyector de optotipos de mesa. Objetivo para proyección de 2 a 6 metros o más. Ajuste de ángulo de proyección con los siguientes optotipos: anillo \"E. Niño o iletrados. Retícula en cruz. Prueba de conciencia horizontal vertical. Prueba de verde-rojo', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7701, '5317140092', 'Proyector para películas de 35 mm para cineangiografía.. Equipo portátil para proyectar películas de cineangiografía de 35 mm como auxiliar en el análisis y diagnóstico cardiológico. Proyector para cineangiografía de 35 mm. Lámpara de xenón o halógeno de 300 Watts. Con posibilidad de manejo de 0 a 7 cuadros por segundo o mayor. Sistema de pausa cinematográfica. Sistema de avance y retroceso de la película rápido y cuadro por cuadro. Que permita proyectar hacia una pantalla fija en la pared.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
