(7704, '5317620028', 'Queratómetro portátil.. Equipo electromédico fijo auxiliar en la exploración para la detección de patologías de refracción. Para determinación de astigmatismo corneal y medidas queratométricas electrónico digital. Con impresora integrada. Con mentonera integrada al equipo. Radios de curvatura dentro del rango de 5.00 a 10.00 en incrementos de 0.1 mm o su equivalente en dioptrías queratométricas. Medidas del eje dentro del rango de 0 a 180 grados en incrementos de un grado. Con panel de control q', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
