(7708, '5317720265', 'Refractor y queratómetro automático.. Aparato que realiza autorrefracción y queratometría en diferentes tipos de pacientes (aun con catarata o con lente intraocular). Autorrefractor y queratómetro con panel de control a 90 o 180 grados con alineamiento automático con rangos de esfera de -17d a +20d en pasos de 0.12d y 0.25d rango del cilindro de -7d a +7d con pasos de 0.12d a 0.25d rango del eje de 0 a 180 ° en pasos de 1 grado. Líneas de agudeza de 20 / 15 a 20 / 400 distancia al vértice de 0.0', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7709, '5317730207', 'Refrigeradores. Refrigerador para cadáveres. Equipo para preservar cadáveres a temperatura de 2 a 8 grados centígrados. Dos gavetas y puertas laterales con bisagras y cerrojos especiales de tambor aisladas. Dos bandejas para cuerpo. Sistema de correderas telescópicas embaleradas para soportar marcos de acero inoxidable con jaladeras integradas. Construido totalmente en lámina de acero inoxidable calibre 20 (cuerpo interior y exterior). Dimensiones 225 x 95 x 220 cm +10%. Sistema de refrigerador ', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
