(7717, '5317810272', 'Ureterorresectoscopio. Endoscopio para observar ureteros con fines diagnósticos y terapéuticos. Endoscopio rígido esterilizable en autoclave que consta de: Telescopio con ángulo visual de 0 ° o 5 ° en visión frontal diámetro 2.8 mm con transmisión de luz por fibra de vidrio incorporada. Vainas para ureterorresectoscopio con llave 12 Fr. Puente de trabajo. Cables de alta frecuencia y tubo protector. Incluye asas de corte electrodos de coagulación cables de alta frecuencia tubo protector y bisturí', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
