(7910, '5332240505', 'Centrífugas. Refrigerada de gabinete con sistema de refrigeración de -15 ° a -30 °C especial para manejo de sangre y sus fracciones para ser usada con recipientes de 600 ml. Rotor horizontal de 6 x 1000 ml. Velocidad entre 6000 a 7000 r.p.m. máxima y entre 7200 y 7500 G de fuerza centrífuga relativa máxima indicador de reemplazo de escobillas puesto en marcha encendido general encendido de la unidad refrigerante desbalanceo terminación de ciclo puerta con sistema de seguridad electromecánico des', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7911, '5332240638', 'Aparatos y equipos. Lector adicional para tubos capilares. Permite la lectura de tubos capilares con sangre centrifugada para proporcionar valores de hematocrito. Con tres receptáculos para tubos amplificación mecánica barra lectora de plástico que amplifica los valores de hematocrito.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(7912, '5332240646', 'Centrífugas. Centrífuga de mesa para ocho tubos de 13 x 100 mm con control de tiempo y velocidad programable tacómetro tapa y sistema de seguridad que evite la apertura durante su funcionamiento interiores de acero inoxidable velocidad hasta 6000 r.p.m.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
