(7925, '5332550218', 'Congelador horizontal de refrigerantes para vacunas. Contenedor de refrigerantes para mantenerlos a temperatura de congelación. Consta de: puerta metálica tipo cofre con sellado hermético cerradura y llave. Construido de material resistente a climas tropicales. Capaz de mantener temperatura en rango de -15 a -20°C. Con control de temperatura canastilla removible ahorrador de energía y tapón de drenado. Las especificaciones de cada uno de los elementos señalados serán determinadas por las unidade', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
