(8059, '5337310162', 'Potenciómetro. Potenciómetro digital. Especialidad(es): Médicas y Quirúrgicas. Servicio(s): Laboratorio Clínico. Descripción: Aparato eléctrico empleado para determinar electroquímicamente concentraciones de iones hidrógeno en soluciones líquidas viscosas o semisólidas. Rango de pH de 0 a 14 ± 0.1 unidades. De 0 a 1999 milivoltios con escala expandida en dos unidades de pH pantalla LCD digital con cuatro cifras y punto desplazable botones de calibración de tacto para pH y milivoltios  compensaci', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(8060, '5337460108', 'Procesadores. Procesador automático de tejidos. Sistema eléctrico que permite incluir tejidos en parafina a través de un tratamiento completo. Capacidad de 110 casetes o cápsulas doce estaciones de operación: canastillas de tamaños diferentes: una de 60 casetes y otra de 120 casetes. Diez Contenedores de melamina o acero inoxidable resistentes a solventes. Dos baños de parafina con posibilidad de aplicar un tercero. Programable de un minuto a 24 horas por cada estación como mínimo. Retraso mínim', 'EQP', '1', 'EQP', 'generico', 'NO', '0000-00-00 00:00:00'),
(8061, '5337690050', 'Recolector. Balanza recolectora y agitador. Instrumento automático para la medición del volumen de sangre extraído con capacidad de movimiento continuo oscilatorio u ondulatorio que permita mezclar la sangre con el anticoagulante de la bolsa recolectora de sangre con monitor de peso que al registrar el volumen de sangre programado obture la línea de llenado. Charola integrada al sistema de movimiento para la colocación de la bolsa colectora.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(8062, '5337710056', 'Congeladores. Accesorio: Registrador de temperatura para siete días; y alarma operada por pilas para avisar por medio de campana y foco.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(8063, '5337710064', 'Graficador.  Graficador para registro continuo de temperatura. Caja con registrador eléctrico con plumilla y tinta. Sensor de temperatura de acero inoxidable. Registro gráfico automático de temperatura diario/semanal. Rango de acuerdo a la temperatura de funcionamiento del equipo. Accesorios: Batería de respaldo. Consume papel gráfico circular y plumillas.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(8064, '5337780034', 'Refractómetros Refractómetro de mano tipo Goldberg temperatura compensada sellado con doble escala: una para medir densidad de la orina entre 1000 y 1035 otra para la concentración de orina y otra para la concentración de proteínas en plasma de 2.5 a 15 g/dL. Escala con tres divisiones 1.010 1.020 y 1.030. Base iluminada.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(8065, '5337860018', 'Refrigeradores. Refrigerador congelador de 5.4 pies cúbicos. Contenedor de material a temperatura de refrigeración para la guarda de insumos de laboratorio. Capacidad de 5.4 pies cúbicos. Tipo vertical. Consta de: Una sola puerta congelador en el mismo cuerpo en la parte superior capaz de mantener temperatura interna de -10 grados C o menor para el congelador y de +2 a +8 grados para el refrigerador. Graficador de temperatura externo fijo para 7 días. Sistema de alarma que permita seleccionar lí', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(8066, '5337860026', 'Refrigeradores. Refrigerador vertical para laboratorio cap. 20 pies cúbicos. Equipo para preservar muestras biológicas medios de cultivo y reactivos de diagnóstico clínico en general a temperaturas de 2 a 8 grados centígrados. Sin congelador. Que opere con refrigerante libre de CFC. Capacidad 571 dm3 (20 pies cúbicos) ± 3 pies cúbicos. Puerta de cristal. Difusor de aire con válvula de presión capilar. Caja del difusor. Entrepaños de alambrón cromado o similar. Deshielo automático. Control de tem', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(8067, '5337860034', 'Refrigerador para vacunas. Contenedor de material a temperatura de refrigeración para la guarda de vacunas. Consta de los siguientes elementos: una sola puerta con sellado hermético con congelador en el mismo cuerpo en la parte superior o sin congelador. La puerta en su parte interna debe ser completamente lisa no debe tener molduras anaqueles ni retenes (liner completamente liso) regatones de acero inoxidable para nivelar en superficies irregulares sin llantas o con llantas con sistema de freno', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(8068, '5337870041', 'Refrigeradores. Vertical. Con puertas de cristal (una o dos) deslizables o abatibles con sobrepuerta de protección que evite la pérdida de temperatura.  Temperatura de operación 4 ° ±1 °C.  Registro gráfico de temperatura integrado para disco de 6 pulgadas alarma visual y acústica por falla de energía eléctrica apertura de puerta o sobre temperatura.  Despliegue digital de temperatura capacidad de 225 hasta 480 Bolsas de 4 a 10 divisiones.  120 V - 60 Hz.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(8069, '5337870066', 'Refrigeradores. Refrigerador para banco de sangre. Equipo eléctrico utilizado para preservar muestras biológicas o hemoderivados a temperatura de 4 a 8 grados centígrados. Panel de temperatura con control computarizado para mantener los cambios de temperatura interna del refrigerador independientemente de la temperatura ambiente. Panel de temperatura digital. Sistema de alarma audible y visual con alimentación eléctrica independiente del refrigerador para cambios de temperatura fallas en la corr', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(8070, '5337870181', 'Refrigerador para laboratorio uso rutinario 14 pies cúbicos. Equipo para preservar muestras biológicas medios de cultivo y reactivos de diagnóstico clínico en general a temperatura de 2 a 8 grados centígrados. Sin congelador. Opera con refrigerante libre de CFC. Vertical Capacidad 400 dm3 (14.2 pies cúbicos). Puerta de cristal con difusor de aire con válvula de presión capilar. Caja del difusor. EntrePaños de alambrón cromado o similar. Deshielo automático. Control de temperatura ajustable con t', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(8071, '5337930027', 'Microtomos. Accesorios: Rejillas para microscopía electrónica.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(8072, '5338140055', 'Sellador. Sellador eléctrico para Tubos. de bolsa de sangre. Operable manualmente. Soporte de goma que lo fijen en caso de requerirlos.  Pinza para sellar el tubo de plástico.  Tiempo de sellado de 1.5 segundos. Sellado automáticamente. Separación de segmentos sin uso de tijeras.', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(8073, '5338190555', 'Unidades. Unidad para incluir tejidos en parafina. Unidad electromecánica que permite incluir tejidos en parafina. Placa calefactora con rango de 55 a 70°C. Placa fría con temperatura hasta -10°C. Superficie de inclusión sellada. Tanque contenedor de parafina removible. Tanque calefactor contenedor de al menos 60 casetes con parrilla y charola removible. Tanque contenedor de parafina de 2 a 5 litros dentro del rango de 45 a 65 ± 0.2°C. Control manual y de pedal del flujo de parafina. Calentador ', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(8074, '5338190571', 'Sistemas automaticados. Sistema automatizado para la detección de crecimiento microbiano en sangre médula ósea y líquidos corporales. Con las siguientes características seleccionables de acuerdo a las necesidades de las unidades médicas: Técnica colorimétrica o fluorescente o por cambio de presión de gases. Gabinete de temperatura constante. Celdillas de incubación y cilindros de reflactancia e indicador fotométrico en cada una. Lector de código de barras. Puerto de comunicación para interfase. ', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(8075, '5338190613', 'Equipo para inmunoensayo. Sistema para análisis inmunológico. Que incluya como principio de medición alguna de las siguientes metodologías: ELISA FIA FPIA ELFA MEIA quimioluminiscencia o electroquimioluminiscencia. Con las siguientes características seleccionables de acuerdo a las necesidades de las unidades médicas: Analitos o estudios a determinar. Capacidad de procesamiento de muestras por hora. Volumen de muestras. Muestras en tubo primario copa copilla o cartucho. Control de temperatura. Id', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(8076, '5338190621', 'Sistema de insuflación para histeroscopía.. Sistema que dilata la cavidad uterina con gas CO2 para facilitar procedimientos diagnósticos y terapéuticos. Aparato insuflador de CO2 para histeroscopía con conexión PIN y preselección de flujo del gas de 0 a 100 ml/min. Presión máxima de insuflación 200 mmHg. Manómetro integrado a la unidad. Despliegue digital de: presión efectiva de insuflación flujo efectivo del gas y volumen de gas utilizado. Dimensiones aproximadas: 360 mm de ancho 150 mm de altu', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(8077, '5338190639', 'Sistema de irrigación para histeroscopía.. Sistema que dilata la cavidad uterina con fluido para facilitar procedimientos diagnósticos y terapéuticos. Bomba de irrigación para histeroscopía con capacidad para proporcionar flujos de fluido de 30 a 450 ml/min y presión de 0 a 150 mmHg. Despliegue digital de: presión efectiva intrauterina preselección de presión y volumen de fluido utilizado. Con opción a detector de burbujas de aire en la tubería y adaptador para determinar diferencias en la escal', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
(8078, '5338190688', 'Analizadores. Analizador de hematología. Equipo para pruebas hematológicas. Con las siguientes características seleccionables de acuerdo a las necesidades de las unidades médicas: Principio de medición: análisis diferencial rayo láser o radiofrecuencia. Impedancia o pulsos cumulativos citoquímica o absorción de luz. Analitos o estudios a determinar por la unidad médica solicitante. Automático o semiautomático. Capacidad de procesamiento de muestras por hora. Volumen de muestra. Reporte de result', '', '', '', 'generico', 'NO', '0000-00-00 00:00:00'),
