(12540, '5640020953', 'Equipo para fortalecimiento de extremidades inferiores. Equipo isocinético bilateral recíproco de carga total o parcial para reentrenamiento de marcha con movimiento de compresión y descompresión alterna para el tratamiento de articulaciones y músculos de las extremidades inferiores en lesiones traumáticas o neurológicas. Con las siguientes características seleccionables de acuerdo a las necesidades de las unidades médicas: velocidad de trabajo funcional y constante de cadena cerrada multiarticu', '', '', '', 'FUENTE UNICA', 'NO', '0000-00-00 00:00:00'),
(12541, '5640020979', 'Barras suecas (espalderas). Barras suecas de una o dos plazas infantil o adulto. Con las siguientes características de acuerdo a las necesidades de las unidades médicas: Barras laterales barras horizontales de madera distribuidas desde la base. Ancho altura.', '', '', '', 'FUENTE UNICA', 'NO', '0000-00-00 00:00:00'),
(12542, '5640020987', 'Espejo para valorar postura. Espejo para valorar simetría postural de una sección. Con las siguientes características seleccionables de acuerdo a las necesidades de las unidades médicas: con luna cuadriculada con dimensiones y marco con base para fijarse a muro.', '', '', '', 'FUENTE UNICA', 'NO', '0000-00-00 00:00:00'),
(12543, '5640020995', 'Espejo de tres secciones (tridimensional) con apertura ajustable marcos de madera barnizados base con ruedas para su desplazamiento con sistema de frenado medidas de 180 x 70 + 10 cm en cada sección.', '', '', '', 'FUENTE UNICA', 'NO', '0000-00-00 00:00:00'),
(12544, '5640021019', 'Equipo para fortalecer tobillo. Aparato portátil que permite la reeducación del tobillo en pacientes con lesiones musculoesqueléticas. Con las siguientes características seleccionables de acuerdo a las necesidades de las unidades médicas: que permita rango completo de los movimientos del tobillo con capacidad para graduar la resistencia. Material.', '', '', '', 'FUENTE UNICA', 'NO', '0000-00-00 00:00:00'),
(12545, '5640021050', 'Mesa kanavel. Mesa modelo Kanavel para ejercitar los músculos de: mano muñeca y antebrazo para trabajar con o sin resistencia. Resistencia axial del peso ajustable que permite la pronación del antebrazo supinación y circunducción de la muñeca. Material dimensiones poleas y pesas de acuerdo a necesidades de tratamiento de unidades médicas.', '', '', '', 'FUENTE UNICA', 'NO', '0000-00-00 00:00:00'),
(12546, '5640021068', 'Muleta tipo canadiense. Muleta tipo canadiense construida en aluminio anodizado con altura ajustable de 66 a 89 cm + 5% con incrementos de 2 cm con agarradera forrada en vinil brazalete con altura ajustable de 18 a 25 cm + 5% con incrementos de 2 cm regatón de apoyo construido en material antiderrapante.', '', '', '', 'FUENTE UNICA', 'NO', '0000-00-00 00:00:00'),
(12547, '5640021076', 'Muletilla. Muletillas de madera o metal (dos piezas) con altura de 25 a 40 cm mango con protección de plástico resistente base de apoyo amplia.', '', '', '', 'FUENTE UNICA', 'NO', '0000-00-00 00:00:00'),
(12548, '5640021084', 'Plomada para valorar postura.. Plomada para valorar alineación y simetría en defectos posturales. Con las siguientes características seleccionables de acuerdo a las necesidades de las unidades médicas: pesilla con perforación central que permita la introducción del hilo. Con peso de acuerdo a las necesidades de las Unidades Médicas.', '', '', '', 'FUENTE UNICA', 'NO', '0000-00-00 00:00:00'),
(12549, '5640021092', 'Poleas dobles fijas a la pared. Poleas dobles fijas a la pared. Con las siguientes características seleccionables de acuerdo a las necesidades de las unidades médicas: un par a la altura del pecho y un par a la altura del piso con ajuste de altura para gimnasio para realizar ejercicios de hombro codo cadera y rodilla. Agarraderas cuerda juego de pesas.', '', '', '', 'FUENTE UNICA', 'NO', '0000-00-00 00:00:00'),
(12550, '5640021100', 'Rueda para ejercicio de brazo y hombro. Rueda para incrementar arcos de movilidad de hombro. Con las siguientes características seleccionables de acuerdo a las necesidades de las unidades médicas: Diámetro giro y material. Dial en grados con ajuste de resistencia.', '', '', '', 'FUENTE UNICA', 'NO', '0000-00-00 00:00:00'),
(12551, '5640021118', 'Silla con asiento ajustable. Silla alta con asiento ajustable de acero cromado asiento acojinado. Ajuste de altura de 80 a 120 cm + 10% respaldo y asiento con tapicería en plástico. Alto de escalón 25 cm + 10% cubierto con material antiderrapante con cinturón de seguridad.', '', '', '', 'FUENTE UNICA', 'NO', '0000-00-00 00:00:00'),
(12552, '5640021126', 'Tina remolino horizontal.. Equipo para dar tratamiento de hidroterapia para brazos cadera piernas y espalda. Tina de doble pared de acero inoxidable tipo 304 calibre 16 el tanque interior y calibre 18 el tanque exterior sin dobleces con soldadura de arco de punto continuo a prueba de fugas y sin costuras en las uniones. Calentador del tanque con protección de sobretemperatura con resistencia con termostato cuatro ruedas con freno. De 120 cm (largo) x 58 cm (ancho) x 70 cm (profundidad) + 10% ter', '', '', '', 'FUENTE UNICA', 'NO', '0000-00-00 00:00:00'),
(12553, '5640021134', 'Barril de poliuretano 56 cms para entrenamiento de gateo. Instrumento móvil empleado en el tratamiento de rehabilitacion de pacientes pediatricos con padecimientos neuromusculares mediante la enseñanza de patrones de gateo rodamiento y respuesta vestibular. Barril de poliuretano de alta densidad. Resistente a uso rudo. Que permita movimientos rítmicos para efectuar rodamientos. Color llamativo. Con diámetro interior de 40 cm+/- 10%. Con diámetro exterior de 60 cm +/- 10%. Libre de látex.', '', '', '', 'FUENTE UNICA', 'NO', '0000-00-00 00:00:00'),
(12554, '5640021142', 'Movilizador pasivo de hombro. Equipo con unidad de programación para la movilización pasiva de hombro. Con las siguientes características de acuerdo a las necesidades de las unidades médicas: Alcance de movimiento por lo menos en flexión extensión abducción adducción rotación interna y rotación externa. Con funciones ajustables de: Pausa velocidad tiempo de tratamiento programa de calentamiento. Peso y dimensiones (altura ancho y profundidad).', '', '', '', 'FUENTE UNICA', 'NO', '0000-00-00 00:00:00'),
(12555, '5640021159', 'Equipo de láser terapéutico para rehabilitación. Equipo electromédico fijo a carro rodable automatizado de diseño exprofeso para tratamiento de las afecciones del sistema osteomuscular con acción antiedematosa analgésica estimulador de la regeneración tisular y el sistema inmunológico aumenta la microcirculación sanguínea a través de la aplicación de la energía láser.Equipo de rayo láser de chasis metálico para fijar a mesa integrado por panel de control con pantallas con despliegue digital lumí', '', '', '', 'FUENTE UNICA', 'NO', '0000-00-00 00:00:00'),
(12556, '5640021175', 'Helper. Equipo para el fortalecimiento de músculos de mano y antebrazo.  Con  las  siguientes características seleccionables de acuerdo a las necesidades de las unidades médicas: marco rígido manubrio mecanismo de resistencia variable.', '', '', '', 'FUENTE UNICA', 'NO', '0000-00-00 00:00:00'),
(12557, '5640021225', 'ESCALERA Y RAMPA CON BARANDAL.  DESCRIPCIÓN: Equipo para contribuir al fortalecimiento muscular y coordinación de miembros inferiores y superiores. Consta De los siguientes elementos: Escalera y rampa con: barandal. Escalones rampa pasamanos descanso. Las especificaciones de cada uno de los elementos señalados serán determinadas por las unidades médicas de acuerdo a sus necesidades.', '', '', '', 'FUENTE UNICA', 'NO', '0000-00-00 00:00:00'),
(12558, '5640021274', 'SISTEMA DE SOPORTE PARA ENTRENAMIENTO DE MARCHA.  Consta de los siguientes elementos: soporte estacionario o rodable con sistema de frenos; fuente de resistencia; controles; arnés o armadura; resistencia; bandas; dimensiones; ajuste de altura posiciones y peso soportado; compresor; acceso para silla de ruedas. Las especificaciones de cada uno de los elementos señalados serán determinadas por las unidades médicas de acuerdo a sus necesidades.', '', '', '', 'FUENTE UNICA', 'NO', '0000-00-00 00:00:00'),
(12559, '6069080544', 'Tubos. Endobronquial para intubación de bronquio izquierdo de plástico grado médico con diseño del globo bronquial en forma de \"barril\" que permite su sellado marcas numéricas para determinar la profundidad de la colocación del tubo termosensible de doble lumen (bronquial y traqueal) con globo individual de alto volumen y baja presión (traqueal y bronquial) y sus  respectivos globos piloto rotulados con válvulas de autosellado traqueal y bronquial con estilete preinsertado que le permite conserv', '', '', '', 'FUENTE UNICA', 'NO', '0000-00-00 00:00:00');
