(1962, '030000001100', 'Energía Mínimo /100 mL 60 kcal,  Máximo /100 mL70 kcal; Energía  Mínimo /100 mL 250 kJ,  Máximo /100 mL295 kJ. Vitaminas. Vitamina A (expresados en retinol). Mínimo/100 kcal 200 U.I. o 60 µg, Máximo/100 kcal 2,5 µg o 100 U.I., NSR/100 kcal. En caso de productos en polvo debería procurarse conseguir NSR más bajo -; Vitamina D Mínimo/100 kcal 1 µg o 40 U.I., Máximo/100 kcal , NSR/100 kcal En caso de productos en polvo debería procurarse conseguir NSR más bajo-; Vitamina C (Ác. ascórbico) Mínimo/100 kcal 10 mg, Máximo/100 kcal S. E., NSR/100 kcal En caso de productos en polvo debería procurarse conseguir NSR más bajo70 mg; Vitamina B Mínimo/100 kcal 60 µg, Máximo/100 kcal S. E., NSR/100 kcal En caso de productos en polvo debería procurarse conseguir NSR más bajo300 µg; Tiamina (B1) Mínimo/100 kcal 60 µg, Máximo/100 kcal S. E., NSR/100 kcal En caso de productos en polvo debería procurarse conseguir NSR más bajo300 µg; Riboflavina (B2)  Mínimo/100 kcal 80 µg, Máximo/100 kcal S. E., NSR/100 kcal En caso de productos en polvo debería procurarse conseguir NSR más bajo500 µg; Niacina (B3)  Mínimo/100 kcal 300 µg, Máximo/100 kcal S. E., NSR/100 kcal En caso de productos en polvo debería procurarse conseguir NSR más bajo1 500 µg; Piridoxina (B6)  Mínimo/100 kcal 35 µg, Máximo/100 kcal S. E., NSR/100 kcal En caso de productos en polvo debería procurarse conseguir NSR más bajo175 µg; Ácido fólico (B9)  Mínimo/100 kcal 10 µg, Máximo/100 kcal S. E., NSR/100 kcal En caso de productos en polvo debería procurarse conseguir NSR más bajo50 µg; Ácido pantoténico (B5)  Mínimo/100 kcal 400 µg, Máximo/100 kcal S. E., NSR/100 kcal En caso de productos en polvo debería procurarse conseguir NSR más bajo2 000 µg; Cianocobalamina (B12)  Mínimo/100 kcal 0,1 µg, Máximo/100 kcal S. E., NSR/100 kcal En caso de productos en polvo debería procurarse conseguir NSR más bajo1,5 µg; Biotina  (H) Mínimo/100 kcal 1,5 µg, Máximo/100 kcal S. E., NSR/100 kcal En caso de productos en polvo debería procurarse conseguir NSR más bajo10 µg; Vitamina K1  Mínimo/100 kcal 4 µg, Máximo/100 kcal S. E., NSR/100 kcal En caso de productos en polvo debería procurarse conseguir NSR más bajo27 µg; Vitamina E (alfa tocoferol equivalente) Mínimo/100 kcal 0,5 mg, Máximo/100 kcal S. E., NSR/100 kcal En caso de productos en polvo debería procurarse conseguir NSR más bajo5 mg; Nutrimentos inorgánicos (minerales y elementos traza), Sodio (Na) Mínimo/100 kcal 20 mg, Máximo/100 kcal 60 mg, NSR/100 kcal -; Potasio (K) Mínimo/100 kcal 60 mg, Máximo/100 kcal 180 mg, NSR/100 kcal -; Cloro (Cl) Mínimo/100 kcal 50 mg, Máximo/100 kcal 160 mg, NSR/100 kcal -; Calcio (Ca) Mínimo/100 kcal 50 mg, Máximo/100 kcal S. E., NSR/100 kcal 140 mg; Fósforo (P) Mínimo/100 kcal 25 mg, Máximo/100 kcal S. E., NSR/100 kcal 100 mg; La relación Ca:P Mínimo/100 kcal 1:1, Máximo/100 kcal 2:1, NSR/100 kcal -; Magnesio (Mg) Mínimo/100 kcal 5 mg, Máximo/100 kcal S. E., NSR/100 kcal 15 mg; Hierro (Fe) Mínimo/100 kcal 1 mg, Máximo/100 kcal 2 mg, NSR/100 kcal -; Yodo (I) Mínimo/100 kcal 10 µg, Máximo/100 kcal S. E., NSR/100 kcal 60 µg; Cobre (Cu)Mínimo/100 kcal 35 µg, Máximo/100 kcal S. E., NSR/100 kcal 120 µg; Cinc (Zn) Mínimo/100 kcal 0,5 mg, Máximo/100 kcal S. E., NSR/100 kcal 1,5 mg; Manganeso (Mn)Mínimo/100 kcal 1 µg, Máximo/100 kcal S. E., NSR/100 kcal 100 µg; Selenio (Se)Mínimo/100 kcal 1 µg, Máximo/100 kcal S. E., NSR/100 kcal 9 µg; Colina Mínimo/100 kcal 14 mg, Máximo/100 kcal S. E., NSR/100 kcal 50 mg; Mioinositol (Inositol) Mínimo/100 kcal 4 mg, Máximo/100 kcal S. E., NSR/100 kcal 40 mg; L-Carnitina (Carnitina) Mínimo/100 kcal 1,2 mg, Máximo/100 kcal 2,3 mg, NSR/100 kcal -; Taurina Mínimo/100 kcal 4,7 mg, Máximo/100 kcal 12 mg, NSR/100 kcal -; Nucleótidos **) Mínimo/100 kcal 1,9 mg, Máximo/100 kcal 16 mg, NSR/100 kcal -; Fuente de proteína. Contendrá los aminoácidos esenciales **. Lípidos y ácidos grasos. Grasas Mínimo/100 kcal 4,4 g, Máximo/100 kcal 6 g NSR/100 kcal -; ARA Mínimo/100 kcal 7 mg, Máximo/100 kcal S.E. NSR/100 kcal -; DHA Mínimo/100 kcal 7 mg, Máximo/100 kcal S.E. NSR/100 kcal (0,5 % de los ácidos grasos); Relación  ARA: DHA Mínimo/100 kcal 1:1, Máximo/100 kcal 2:1 NSR/100 kcal -; Ácido linoleico Mínimo/100 kcal 300 mg, Máximo/100 kcal S. E. NSR/100 kcal 1 400 mg; Ácido alfa-linolénico Mínimo/100 kcal 50 mg, Máximo/100 kcal S. E. NSR/100 kcal -; Hidratos de carbono. Hidratos de carbono Mínimo/100 kcal 9 g, Máximo/100 kcal 14 g NSR/100 kcal -. Disposiciones Generales. La proporción de ácido linoleico/alfa-linolénico mínimo 5:1, máximo 15:1 De manera opcional, la fuente de proteína podrá contener los aminoácidos esenciales (valina, leucina, isoleucina, treonina, lisina, metionina, fenilalanina y triptófano, y otros, regulados en la NORMA Oficial Mexicana NOM-131-SSA1-2012) y en caso de ser adicionados se listarán en la ficha técnica. El contenido de ácidos grasos trans no será superior al 3% del contenido total de ácidos grasos en las fórmulas para lactantes. En las fórmulas para lactantes sólo podrán añadirse almidones naturalmente exentos de gluten precocidos y/o gelatinizados hasta un máximo de 30% del contenido total de hidratos de carbono y hasta un máximo de 2 g/100 ml. En las fórmulas para lactantes debe evitarse el uso de sacarosa, así como la adición de fructosa como ingrediente, salvo cuando sea necesario por justificación tecnológica. En las fórmulas para lactantes podrán añadirse otros nutrimentos/ingredientes normalmente presentes en la leche materna o humana en cantidad suficiente con la finalidad de lograr el efecto nutrimental o fisiológico de ésta, sobre la base de las cantidades presentes en la leche materna y para asegurarse que sea adecuado como fuente única de la nutrición del lactante. Su idoneidad e inocuidad debe estar demostrada científicamente. Se debe contar con evidencia científica que demuestre la utilidad de los nutrimentos/ingredientes opcionales que se utilicen y estar a disposición de la Secretaría de Salud cuando ésta lo solicite. Las fórmulas que contengan más de 1,8 g de proteínas por cada 100 kcal, deben incrementar el contenido de piridoxina en al menos 15 µg de piridoxina por cada gramo de proteína arriba de dicho valor. En la fórmula lista para ser consumida de acuerdo con las instrucciones descritas en la etiqueta. Si se añade ácido docosahexaenoico (DHA), el contenido de ácido araquidónico debe ser al menos el mismo que el de DHA y el contenido de ácido eicosapentaenoico (EPA) no debe exceder el contenido de DHA. ** Opcional. S.E. Sin Especificación. NSR: Nivel Superior de Referencia. Envase desde 360 g hasta 454 g polvo y medida dosificadora.', 'ENV', '1', 'ENV', '', '0', '0', '0000-00-00', '', '', '', ''),
