(1965, '030000001300', 'Fórmula para lactantes con necesidades especiales de nutrición con proteína extensamente hidrolizada. Polvo o liquido. Energía: Mínimo /100 mL 60 kcal Máximo /100 mL: 85 kcal. Energía: Mínimo /100 mL 250 kJ Máximo /100 mL: 355 kJ. Vitaminas. Vitamina A: Mínimo/100 kcal 200 U.I. o 60 µg expresados en retinol Máximo/100 kcal: 600 U.I. o 180 µg expresados en retinol NSR/100 kcal: - Vitamina D: Mínimo/100 kcal: 1 µg o 40 U.I. Máximo/100 kcal:  25 µg o 100 U.I. NSR/100 kcal: - Vitamina C (Ac. ascórbico): Mínimo/100 kcal: 10 mg Máximo/100 kcal:  S. E. NSR/100 kcal: 70 mg Tiamina (B1): Mínimo/100 kcal: 60 µg Máximo/100 kcal:  S. E. NSR/100 kcal: 300 µg Riboflavina (B2): Mínimo/100 kcal: 80 µg Máximo/100 kcal:  S. E. NSR/100 kcal: 500 µg Niacina (B3): Mínimo/100 kcal: 300 µg Máximo/100 kcal:  S. E. NSR/100 kcal: 1 500 µg Piridoxina (B6): Mínimo/100 kcal: 35 µg Máximo/100 kcal:  S. E. NSR/100 kcal: 175 µg Ácido fólico (B9): Mínimo/100 kcal: 10 µg Máximo/100 kcal:  S. E. NSR/100 kcal: 50 µg Ácido pantoténico (B5): Mínimo/100 kcal: 400 µg Máximo/100 kcal:  S. E. NSR/100 kcal: 2 000 µg Cianocobalamina (B12): Mínimo/100 kcal: 01 µg Máximo/100 kcal:  S. E. NSR/100 kcal: 15 µg Biotina (H): Mínimo/100 kcal: 15 µg Máximo/100 kcal:  S. E. NSR/100 kcal: 10 µg Vitamina K1: Mínimo/100 kcal: 4 µg Máximo/100 kcal:  S. E. NSR/100 kcal: 27 µg Vitamina E (alfa tocoferol equivalente): Mínimo/100 kcal:  05 mg Máximo/100 kcal:  S. E. NSR/100 kcal: 5 mg. Nutrimentos inorgánicos (minerales y elementos traza). Sodio (Na) 20 mg 60 mg - Potasio (K) 60 mg 180 mg - Cloro (Cl) 50 mg 160 mg - Calcio (Ca) 50 mg S. E. 140 mg Fósforo (P) 25 mg S. E. 100 mg Ca : P 1:1 2:1 Magnesio (Mg) 5 mg S. E. 15 mg Hierro (Fe) 1 mg 2 mg Colina 75 mg S. E. 50 mg Mioinositol (Inositol) 4 mg S. E. 40 mg L-Carnitina (Carnitina) 12 mg 50 mg - Taurina 55 mg 12 mg - Yodo (I) 10 µg S. E. 60 µg Cobre (Cu) 35 µg S. E. 120 µg Cinc (Zn) 05 mg S. E. 15 mg Manganeso (Mn) 10 µg S. E. 100 µg Selenio (Se) 1 µg S. E. 9 µg Cromo (Cr) ** 15 µg S. E. 10 µg Molibdeno (Mo) ** 15 µg S. E. 10 µg Nucleótidos ** 19 mg 16 mg -. Fuente de proteína (se debe indicar el origen del hidrolizado de proteína) Contendrá los aminoácidos esenciales**  Proteína hidrolizada de caseína o suero: Péptidos 85% o más con menos de 1 500 Daltons 225 g 30 g. Lípidos y ácidos grasos Grasas 44 g 6 g - ARA** 7 mg S.E. DHA** 7 mg S.E. 05% de los ácidos grasos Relación ARA: DHA** 1:1 2:1 Ácido linoléico 300 mg S. E. 1 400 mg Ácido alfa-linolénico 50 mg S. E. - Hidratos de carbono. Hidratos de carbono 9 g 14 g -. Disposiciones Generales De manera opcional la fuente de proteína podrá contener los aminoácidos esenciales (valina leucina isoleucina treonina lisina metionina fenilalanina y triptofano y otros regulados en la NORMA Oficial Mexicana NOM-131-SSA1- 2012) y en caso de ser adicionados se listarán en la ficha técnica. Para mejorar la calidad nutritiva de las proteínas podrán añadir aminoácidos en las cantidades estrictamente necesarias los cuáles deben ser en su forma natural L. La proporción de ácido linoleico/alfa-linolénico mínimo 5:1 máximo 15:1 El contenido de ácidos grasos trans no será superior al 3% del contenido total de ácidos grasos en las fórmulas para lactantes con necesidades especiales de nutrición En las fórmulas para lactantes con necesidades especiales de nutrición sólo podrán añadirse almidones naturalmente exentos de gluten precocidos y/o gelatinizados hasta un máximo de 30% del contenido total de hidratos de carbono y hasta un máximo de 2 g/100 ml. En las fórmulas para lactantes con necesidades especiales de nutrición debe evitarse el uso de sacarosa así como la adición de fructosa como ingrediente salvo cuando sea necesario por justificación tecnológica. En las fórmulas para lactantes con necesidades especiales de nutrición podrán añadirse otros nutrimentos/ingredientes normalmente presentes en la leche materna o humana en cantidad suficiente con la finalidad de lograr el efecto nutrimental o fisiológico de ésta sobre la base de las cantidades presentes en la leche materna y para asegurarse que sea adecuado como fuente única de la nutrición del lactante. Su idoneidad e inocuidad debe estar demostrada científicamente. Se debe contar con evidencia científica que demuestre la utilidad de los nutrimentos/ingredientes opcionales que se utilicen y estar a disposición de la Secretaría de Salud cuan do ésta lo solicite. Las fórmulas que contengan más de 18 g de proteínas por cada 100 kcal deben incrementar el contenido de piridoxina en al menos 15 µg de piridoxina por cada gramo de proteína arriba de dicho valor. En la fórmula lista para ser consumida de acuerdo con las instrucciones descritas en la etiqueta. Las instituciones podrán solicitar que se especifique el origen del hidrolizado de proteína y en caso de ser mixto la relación de la misma lo cual será expresado en la ficha técnica. Si se añade ácido docosahexaenoico (DHA) el contenido de ácido araquidónico debe ser al menos el mismo que el de DHA y el contenido de ácido eicosapentaenoico (EPA) no debe exceder el contenido de DHA. ** Opcional S.E. Sin Especificación NSR: Nivel Superior de Referencia. Envase desde 357 g hasta 450 g polvo y medida dosificadora.', 'ENV', '1', 'ENV', '', '0', '0', '0000-00-00', '', '', '', ''),
