iotina (H) Mínimo/100 kcal 1,5 µg, Máximo/100 kcal S. E., NSR/100 kcal. En el caso de productos en polvo debería procurarse conseguir NSR más bajos. 10 µg; Vitamina K1 Mínimo/100 kcal 4 µg, Máximo/100 kcal S. E., NSR/100 kcal. En el caso de productos en polvo debería procurarse conseguir NSR más bajos. 27 µg; Vitamina E (alfa tocoferol equivalente) Mínimo/100 kcal 0,5 mg, Máximo/100 kcal S. E., NSR/100 kcal. En el caso de productos en polvo debería procurarse conseguir NSR más bajos. 5 mg; Nutrimentos inorgánicos (minerales y elementos traza). Sodio (Na) Mínimo/100 kcal 20 mg, Máximo/100 kcal 60 mg, NSR/100 kcal -; Potasio (K) Mínimo/100 kcal 60 mg, Máximo/100 kcal 180 mg, NSR/100 kcal -; Cloro (Cl) Mínimo/100 kcal 50 mg, Máximo/100 kcal 160 mg, NSR/100 kcal -; Calcio (Ca) Mínimo/100 kcal 50 mg, Máximo/100 kcal S.E., NSR/100 kcal 140 mg; Fósforo (P) Mínimo/100 kcal 25 mg, Máximo/100 kcal S.E., NSR/100 kcal 100 mg; La relación Ca:P Mínimo/100 kcal 1:1, Máximo/100 kcal 2:1, NSR/100 kcal -; Magnesio (Mg) Mínimo/100 kcal 5 mg, Máximo/100 kcal S.E., NSR/100 kcal 15 mg; Hierro (Fe) Mínimo/100 kcal 1 mg, Máximo/100 kcal 2  mg, NSR/100 kcal -; Colina Mínimo/100 kcal 7 mg, Máximo/100 kcal S.E., NSR/100 kcal 50 mg; Mioinositol (Inositol) Mínimo/100 kcal 4 mg, Máximo/100 kcal S.E., NSR/100 kcal 40 mg; L-Carnitina (Carnitina) Mínimo/100 kcal 1,2 mg, Máximo/100 kcal S.E., NSR/100 kcal -; Taurina Mínimo/100 kcal 5,5 mg, Máximo/100 kcal 12 mg, NSR/100 kcal -; Yodo (I) Mínimo/100 kcal 10 µg, Máximo/100 kcal S.E., NSR/100 kcal 60 µg; Cobre (Cu) Mínimo/100 kcal 35 µg, Máximo/100 kcal S.E., NSR/100 kcal 120 µg; Cinc (Zn) Mínimo/100 kcal 0,5 mg, Máximo/100 kcal S.E., NSR/100 kcal 1,5 mg; Manganeso (Mn) Mínimo/100 kcal 1 µg, Máximo/100 kcal S.E., NSR/100 kcal 100 µg; Selenio (Se) Mínimo/100 kcal 1 µg, Máximo/100 kcal S.E., NSR/100 kcal 9 µg; Cromo (Cr) ** Mínimo/100 kcal 1,5 µg, Máximo/100 kcal S.E., NSR/100 kcal 10 µg; Molibdeno (Mo) ** Mínimo/100 kcal 1,5 µg, Máximo/100 kcal S.E., NSR/100 kcal 10 µg; Nucleótidos ** Mínimo/100 kcal 1,9 mg, Máximo/100 kcal 16 mg, NSR/100 kcal -; Fuente de proteína (se debe indicar el origen del hidrolizado de proteína). Proteína hidrolizada de caseína o suero: Péptidos 85% o más con menos de 1 500 Daltons Mínimo/100 kcal 2,25 g, Máximo/100 kcal 3,0 g, NSR/100 kcal -; Lípidos y ácidos grasos. Grasas Mínimo/100 kcal 4,4 g, Máximo/100 kcal 6 g, NSR/100 kcal -; Ácido linoleico Mínimo/100 kcal 300 mg, Máximo/100 kcal S.E., NSR/100 kcal 1 400 mg; Ácido alfa-linolénico Mínimo/100 kcal 50 mg, Máximo/100 kcal S.E., NSR/100 kcal -; Relación ácido linoleico/ácido alfa linolénico Mínimo/100 kcal 5:1, Máximo/100 kcal 15:1, NSR/100 kcal -; ARA Mínimo/100 kcal 7 mg, Máximo/100 kcal S.E., NSR/100 kcal -; DHA Mínimo/100 kcal 7 mg, Máximo/100 kcal S.E., NSR/100 kcal 0,5% de los ácidos grasos; Relación ARA:DHA Mínimo/100 kcal 1:1, Máximo/100 kcal 2:1, NSR/100 kcal -; Triglicéridos de Cadena Media Mínimo/100 kcal 30% de los ácidos grasos totales, Máximo/100 kcal 65% de los ácidos grasos totales, NSR/100 kcal -; Hidratos de carbono. Hidratos de carbono Mínimo/100 kcal 9 g, Máximo/100 kcal 14 g, NSR/100 kcal -. Disposiciones Generales. Esta formulación deberá ser libre de lactosa (? 0,1 g/100kcal) Las fórmulas para lactantes con necesidades especiales de nutrición que contengan más de 1,8 g de proteínas por cada 100 kcal, deben incrementar el contenido de piridoxina en al menos 15 µg de piridoxina por cada gramo de proteína arriba de dicho valor. En la fórmula lista para ser consumida de acuerdo con las instrucciones descritas en la etiqueta. Para mejorar la calidad nutritiva de las proteínas, podrán añadirse aminoácidos indispensables, únicamente en las cantidades estrictamente necesarias, los cuales deben ser en su forma natural L. Esta información deberá expresarse en la ficha técnica. En las fórmulas para lactantes con necesidades especiales de nutrición sólo podrán añadirse almidones naturalmente exentos de gluten precocidos y/o gelatinizados hasta un máximo de 30% del contenido total de hidratos de carbono y hasta un máximo de 2 g/100 ml. En las fórmulas para lactantes con necesidades especiales de nutrición debe evitarse el uso de sacarosa, así como la adición de fructosa como ingrediente, salvo cuando sea necesario por justificación tecnológica. En las fórmulas para lactantes con necesidades especiales de nutrición podrán añadirse otros nutrimentos/ingredientes normalmente presentes en la leche materna o humana en cantidad suficiente con la finalidad de lograr el efecto nutrimental o fisiológico de ésta, sobre la base de las cantidades presentes en la leche materna y para asegurarse que sea adecuado como fuente única de la nutrición del lactante. Su idoneidad e inocuidad debe estar demostrada científicamente. Se debe contar con evidencia científica que demuestre la utilidad de los nutrimentos/ingredientes opcionales que se utilicen y estar a disposición de la Secretaría cuando ésta lo solicite. Si se añade ácido docosahexaenoico (DHA), el contenido de ácido araquidónico debe ser al menos el mismo que el de DHA y el contenido de ácido eicosapentaenoico (EPA) no debe exceder el contenido de DHA. Las instituciones podrán solicitar que se especifique el origen del hidrolizado de proteína y en caso de ser mixto la relación de la misma, lo cual será expresado en la ficha técnica. ** Opcional. S.E. Sin Especificación NSR: Nivel Superior de Referencia. Envase desde 400 g hasta 454 g polvo y medida dosificadora.', 'ENV', '1', 'ENV', '', '0', '0', '0000-00-00', '', '', '', '');
