teína equivalente) Mínimo/100 kcal 2,25 g, Máximo/100 kcal 3 g, NSR/100 kcal -; % aminoácidos libres  Mínimo/100 kcal 100, Máximo/100 kcal -, NSR/100 kcal -; Cistina  Mínimo/100 kcal 38 mg, Máximo/100 kcal 87 mg, NSR/100 kcal -; Histidina Mínimo/100 kcal 41 mg, Máximo/100 kcal 130 mg, NSR/100 kcal -; Isoleucina Mínimo/100 kcal 92 mg, Máximo/100 kcal 227 mg, NSR/100 kcal -; Leucina Mínimo/100 kcal 169 mg, Máximo/100 kcal 412 mg, NSR/100 kcal -; Lisina Mínimo/100 kcal 114 mg, Máximo/100 kcal 268 mg, NSR/100 kcal -; Metionina Mínimo/100 kcal 24 mg, Máximo/100 kcal 78 mg, NSR/100 kcal -; Fenilalanina Mínimo/100 kcal 81 mg, Máximo/100 kcal 169 mg, NSR/100 kcal -; Treonina Mínimo/100 kcal 77 mg, Máximo/100 kcal 206 mg, NSR/100 kcal -; Triptófano Mínimo/100 kcal 33 mg, Máximo/100 kcal 80 mg, NSR/100 kcal -; Valina Mínimo/100 kcal 90 mg, Máximo/100 kcal 254 mg, NSR/100 kcal -; Lípidos y ácidos grasos. Grasas  Mínimo/100 kcal 4,4 g, Máximo/100 kcal 6 g, NSR/100 kcal -; ARA  Mínimo/100 kcal 7 mg, Máximo/100 kcal S.E., NSR/100 kcal -; DHA  Mínimo/100 kcal 7 mg, Máximo/100 kcal S.E., NSR/100 kcal 0,5% de los ácidos grasos; Relación ARA:DHA Mínimo/100 kcal 1:1, Máximo/100 kcal 2:1, NSR/100 kcal -; Ácido linoleico  Mínimo/100 kcal 300 mg, Máximo/100 kcal S.E., NSR/100 kcal 1 400 mg; Ácido alfa-linolénico  Mínimo/100 kcal 50 mg, Máximo/100 kcal S.E., NSR/100 kcal -; Hidratos de carbono. Hidratos de carbono Mínimo/100 kcal 9 g, Máximo/100 kcal 14 g, NSR/100 kcal -. Disposiciones Generales Esta formulación deberá ser libre de lactosa (= 0,1 g/100kcal) Las fórmulas para lactantes con necesidades especiales de nutrición que contengan más de 1,8 g de proteínas por cada 100 kcal, deben incrementar el contenido de piridoxina en al menos 15 µg de piridoxina por cada gramo de proteína arriba de dicho valor. En la fórmula lista para ser consumida de acuerdo con las instrucciones descritas en la etiqueta. Para mejorar la calidad nutritiva de las proteínas, podrán añadirse aminoácidos indispensables, únicamente en las cantidades estrictamente necesarias, los cuales deben ser en su forma natural L. La lista de aminoácidos se expresará en la ficha técnica. La proporción de ácido linoleico/alfa-linolénico mínimo 5:1, máximo 15:1. El contenido de ácidos grasos trans no será superior al 3% del contenido total de ácidos grasos en las fórmulas para lactantes con necesidades especiales de nutrición. En las fórmulas para lactantes con necesidades especiales de nutrición solo podrán añadirse almidones naturalmente exentos de gluten precocidos y/o gelatinizados hasta un máximo de 30% del contenido total de hidratos de carbono y hasta un máximo de 2 g/100 ml. En las fórmulas para lactantes con necesidades especiales de nutrición debe evitarse el uso de sacarosa, así como la adición de fructosa como ingrediente, salvo cuando sea necesario por justificación tecnológica. En las fórmulas para lactantes con necesidades especiales de nutrición podrán añadirse otros nutrimentos/ingredientes normalmente presentes en la leche materna o humana en cantidad suficiente con la finalidad de lograr el efecto nutrimental o fisiológico de ésta, sobre la base de las cantidades presentes en la leche materna y para asegurarse que sea adecuado como fuente única de la nutrición del lactante. Su idoneidad e inocuidad debe estar demostrada científicamente. Se debe contar con evidencia científica que demuestre la utilidad de los nutrimentos/ingredientes opcionales que se utilicen y estar a disposición de la Secretaría cuando ésta lo solicite. Si se añade ácido docosahexaenoico (DHA), el contenido de ácido araquidónico debe ser al menos el mismo que el de DHA y el contenido de ácido eicosapentaenoico (EPA) no debe exceder el contenido de DHA. ** Opcional S.E. Sin Especificación NSR: Nivel Superior de Referencia. Envase con 400 g polvo y medida dosificadora.', 'ENV', '1', 'ENV', '', '0', '0', '0000-00-00', '', '', '', ''),
