0 kcal2,73 mg, NSR/100 kcal - ; Manganeso (Mn) Mínimo/100 kcal 0,5 µg, Máximo/100 kcal27,4 µg, NSR/100 kcal - ; Selenio (Se) Mínimo/100 kcal 0,9 µg, Máximo/100 kcal9 µg, NSR/100 kcal - ; Cromo (Cr)** Mínimo/100 kcal 0,02 µg, Máximo/100 kcal5,9 µg, NSR/100 kcal - ; Molibdeno (Mo)** Mínimo/100 kcal 0,2 µg, Máximo/100 kcal5,9 µg, NSR/100 kcal - ; Colina** Mínimo/100 kcal 7,3 mg, Máximo/100 kcal50 mg, NSR/100 kcal - ; Mioinositol (Inositol)** Mínimo/100 kcal 4 mg, Máximo/100 kcal48 mg, NSR/100 kcal - ; L-carnitina (Carnitina)** Mínimo/100 kcal 1,2 mg, Máximo/100 kcalS.E., NSR/100 kcal - ; Taurina** Mínimo/100 kcal S.E., Máximo/100 kcal12 mg, NSR/100 kcal - ; Nucleótidos** Mínimo/100 kcal S.E., Máximo/100 kcalS.E., NSR/100 kcal - ; Fuente de proteína. Contendrá los aminoácidos esenciales**. Se debe indicar el origen del hidrolizado de proteína. Leche de vaca Mínimo/100 kcal 1,8 g, Máximo/100 kcal3,8 g, NSR/100 kcal - ; Parcialmente Hidrolizada  Mínimo/100 kcal 2,25 g, Máximo/100 kcal3 g, NSR/100 kcal - ; Lípidos y ácidos grasos: Lípidos Mínimo/100 kcal 4,4 g, Máximo/100 kcal6 g, NSR/100 kcal - ; Ácido Linoleico Mínimo/100 kcal 0,35 g, Máximo/100 kcal1,4 g, NSR/100 kcal - ; Ácido Alfa-Linolénico Mínimo/100 kcal 0,05 g, Máximo/100 kcalS.E., NSR/100 kcal - ; Ácido Araquidónico (ARA)** Mínimo/100 kcal 16 mg, Máximo/100 kcal35 mg, NSR/100 kcal - ; Ácido docosahexaenoico (DHA)** Mínimo/100 kcal 9 mg, Máximo/100 kcal21 mg, NSR/100 kcal - ; Relación ARA:DHA Mínimo/100 kcal -, Máximo/100 kcal-, NSR/100 kcal - ; Hidratos de carbono: Hidratos de carbono Mínimo/100 kcal 10 g, Máximo/100 kcal12 g, NSR/100 kcal - . Disposiciones Generales. La proporción de ácido linoleico/alfa-linolénico mínimo 5:1, máximo 15:1. De manera opcional, la fuente de proteína podrá contener los aminoácidos esenciales (valina, leucina, isoleucina, treonina, lisina, metionina, fenilalanina y triptófano, y otros, regulados en la NORMA Oficial Mexicana NOM-131-SSA1-2012) y en caso de ser adicionados se listarán en la ficha técnica. El contenido de ácidos grasos trans no será superior al 3% del contenido total de ácidos grasos en las fórmulas para lactantes. En las fórmulas para lactantes sólo podrán añadirse almidones naturalmente exentos de gluten precocidos y/o gelatinizados hasta un máximo de 30% del contenido total de hidratos de carbono y hasta un máximo de 2 g/100 ml. En las fórmulas para lactantes debe evitarse el uso de sacarosa, así como la adición de fructosa como ingrediente, salvo cuando sea necesario por justificación tecnológica. En las fórmulas para lactantes podrán añadirse otros nutrimentos/ingredientes normalmente presentes en la leche materna o humana en cantidad suficiente con la finalidad de lograr el efecto nutrimental o fisiológico de ésta, sobre la base de las cantidades presentes en la leche materna y para asegurarse que sea adecuado como fuente única de la nutrición del lactante. Su idoneidad e inocuidad debe estar demostrada científicamente. Se debe contar con evidencia científica que demuestre la utilidad de los nutrimentos/ingredientes opcionales que se utilicen y estar a disposición de la Secretaría de Salud cuando ésta lo solicite. Las fórmulas que contengan más de 1,8 g de proteínas por cada 100 kcal, deben incrementar el contenido de piridoxina en al menos 15 µg de piridoxina por cada gramo de proteína arriba de dicho valor. En la fórmula lista para ser consumida de acuerdo con las instrucciones descritas en la etiqueta. Si se añade ácido docosahexaenoico (DHA), el contenido de ácido araquidónico debe ser al menos el mismo que el de DHA y el contenido de ácido eicosapentaenoico (EPA) no debe exceder el contenido de DHA. ** Opcional. S.E. Sin Especificación. NSR: Nivel Superior de Referencia. En caso de productos en polvo debería procurarse conseguir NSR más bajo. Envase desde 400 g polvo y medida dosificadora.', 'ENV', '1', 'ENV', '', '0', '0', '0000-00-00', '', '', '', ''),
